INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (62, '1955-03-19', NULL, 'Walter Bruce Willis, better known as Bruce Willis, is an American actor and producer. His career began in television in the 1980s and has continued both in television and film since, including comedic, dramatic, and action roles. He is well known for the role of John McClane in the Die Hard series.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (64, '1958-03-21', NULL, 'Gary Leonard Oldman (born 21 March 1958) is an English actor, filmmaker and musician, well-known to audiences for his portrayals of dark and morally ambiguous characters. He has starred in films such as Sid and Nancy, Prick Up Your Ears, JFK, Dracula, True Romance, Léon, The Fifth Element, The Contender, the Harry Potter film series and the Batman film series, as well as in television shows such as Friends and Fallen Angels.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (65, '1931-09-12', NULL, 'Sir Ian Holm, CBE (born 12 September 1931) is a British actor known for his stage work and for many film roles. He received the 1967 Tony Award for Best Featured Actor for his performance as Lenny in The Homecoming and the 1998 Laurence Olivier Award for Best Actor for his performance in the title role of King Lear. He was nominated for the 1981 Academy Award for Best Supporting Actor for his role as athletics trainer Sam Mussabini in Chariots of Fire. Other well-known film roles include the android Ash in Alien, Father Vito Cornelius in The Fifth Element, and the hobbit Bilbo Baggins in the first and third films of the Lord of the Rings film trilogy.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (63, '1975-12-17', NULL, 'Milla Jovovich, born as Milica Natasha Jovovich, is an Ukrainian-born actress, an American supermodel, musician, and fashion designer.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (66, '1972-08-31', NULL, 'Christopher "Chris" Tucker (born August 31, 1972) is an American actor and comedian, best known for his roles as Detective James Carter in the Rush Hour trilogy and Smokey in the 1995 film Friday.  Tucker was born in Atlanta, Georgia, the youngest son of Mary Louise and Norris Tucker. Tucker was raised in Decatur, Georgia. After graduating from Columbia High School, he moved to Los Angeles to pursue a career in comedy and movies. In 1992, Tucker was a frequent performer on Def Comedy Jam. He made his cinematic debut in House Party 3, and gained greater film recognition alongside rapper Ice Cube in the 1995 film Friday. In 1997, he co-starred with Charlie Sheen in Money Talks, and alongside Bruce Willis in The Fifth Element. Tucker did not reprise his role of Smokey in Next Friday (2000) because he had become a born-again Christian after filming Money Talks (1997).He later starred in the 1998 martial arts action comedy Rush Hour and its sequels, Rush Hour 2 and Rush Hour 3, in which he played James Carter, an abrasive wise-cracking detective.  Tucker is good friends with fellow Rush Hour star Jackie Chan, and was also close friends with the late singer Michael Jackson, introducing and dancing with him at his 30th Anniversary Special, appearing in Jackson''s video "You Rock My World" from his 2001 album Invincible and attending Jackson''s memorial service. A friend of Bill Clinton, Tucker has traveled with the former President overseas, though he endorsed Barack Obama rather than Hillary Clinton in the 2008 primaries. On February 13, 2009, Tucker participated in the NBA All-Star Weekend''s Celebrity Game.', 0, 'Atlanta, Georgia', 'Chris Tucker');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (8395, '1965-10-11', NULL, 'Luke Perry (born Coy Luther Perry III; October 11, 1965) is an American actor. Perry starred as Dylan McKay on the TV series Beverly Hills, 90210, a role he played from 1990–95, and then from 1998–2000. Much publicity was garnered over the fact that even though he was playing a sixteen-year-old when 90210 began, Perry was actually in his mid twenties at that time. Perry returned to 90210 in 1998 (this time billed as a permanent "Special Guest Star") and remained with the series until its conclusion in 2000.', 2, 'Mansfield - Ohio - USA', 'Luke Perry');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (313, '1959-07-10', NULL, 'Ellen Kuras ASC (born July 10, 1959 in New Jersey) is an American cinematographer and director. She has collaborated several times with directors Michel Gondry and Spike Lee. In 2013 she was a member of the jury at the 63rd Berlin International Film Festival.
