INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2955, '1951-07-09', NULL, 'Christopher W. "Chris" Cooper (born July 9, 1951) is an American film actor. He became well known in the late 1990s, having appeared in supporting performances in several major Hollywood films, including The Bourne Identity, American Beauty, Capote, The Town, The Kingdom, Syriana, October Sky, Seabiscuit, and Adaptation, for which he won both the Academy Award and Golden Globe Award for Best Supporting Actor.
