INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (134, '1967-12-13', NULL, 'Eric Marlon Bishop (born December 13, 1967), professionally known as Jamie Foxx, is an American actor, singer-songwriter, stand-up comedian, and talk radio host. As an actor, his work in the film Ray earned him the Academy Award and BAFTA Award for Best Actor as well as the Golden Globe Award for Best Actor in a musical/comedy. He is also a Grammy Award winning musician, producing two albums which have charted highly on the Billboard 200: Unpredictable, which topped the chart, and Intuition.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (131, '1980-12-19', NULL, '​American actor Jake Gyllenhaal was born in Los Angeles, CA on December 19, 1980.  Jake has been involved with acting from an early age, which is no surprise considering his family history of directors and screenwriters.  Throughout his childhood Jake worked in several films directed by his father Stephen, but was discouraged from accepting extensive roles that would impact his studies. After finishing high school Jake''s breakthrough acting role was October Sky (1999), where he played an amateur rocket scientist eager to break away from his destiny of working in a coal mine.  Jake''s most acclaimed performance to date was co-starring along side Heath Ledger in the popular 2005 film, Brokeback Mountain.  Jake has starred in more recent films such as Love an Other Drugs (2010), and Source Code (2011).', 2, 'Los Angeles, California, USA', 'Jake Gyllenhaal');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (132, NULL, NULL, 'From Wikipedia, the free encyclopedia.  Scott MacDonald (born 1959) is an American actor. He is best known for his recurring roles as Captain Manning on short-lived series Threshold, Burley from HBO series Carnivàle, and as Commander Dolim from Star Trek: Enterprise, and as the title character from 1996 horror film Jack Frost.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (155, '1982-11-29', NULL, 'Lucas York Black (born November 29, 1982) is an American film and television actor. He is known for his roles in the CBS television series American Gothic as well as roles in films such as Sling Blade, Jarhead, Friday Night Lights, The Fast and the Furious: Tokyo Drift, Legion and Get Low.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (133, '1971-03-07', NULL, 'John Peter Sarsgaard (born March 7, 1971) is an American film and stage actor. He landed his first feature role in the movie Dead Man Walking in 1995. He then appeared in the 1998 independent films Another Day in Paradise and Desert Blue. That same year, Sarsgaard received a substantial role in The Man in the Iron Mask (1998), playing Raoul, the son of Athos. Sarsgaard later achieved critical recognition when he was cast in Boys Don''t Cry (1999) as John Lotter. He landed his first leading role in the 2001 film The Center of the World. The following year, he played supporting roles in Empire, The Salton Sea, and K-19: The Widowmaker. For his portrayal of Charles Lane in Shattered Glass, Sarsgaard won the Online Film Critics Society Award in the category for Best Supporting Actor and was nominated for the 2004 Golden Globe Award for Best Supporting Actor.
