INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (142, '1944-10-08', NULL, 'From Wikipedia, the free encyclopedia.  William Dodson Broyles, Jr. (born October 8, 1944) is an American screenwriter, who has worked on the television series China Beach (1988–1991), and the films Apollo 13 (1995), Cast Away (2000), Entrapment (1999), Planet of the Apes (2001), Unfaithful (2002), The Polar Express (2004), and Jarhead (2005). He also assisted in the screenplay of "Saving Private Ryan" (1998).
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (148, '1970-08-12', NULL, 'From Wikipedia, the free encyclopedia.  Anthony Swofford (born August 12, 1970 in Fairfield, California) is a United States Marine and is author of the book Jarhead, published in 2003, which is primarily based on his accounts of various situations encountered in the first Gulf War. This memoir was the basis of the 2005 movie of the same name, directed by Sam Mendes.  The title is derived from the name of the traditional high and tight haircuts favored by the Marines.  Description above from the Wikipedia article Anthony Swofford, Jr., licensed under CC-BY-SA, full list of contributors on Wikipedia.     ', 0, 'Fairfield, California', 'Anthony Swofford');
