INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (204, '1975-10-05', NULL, 'Kate Elizabeth Winslet (born 5 October 1975) is an English actress and occasional singer. She has received multiple awards and nominations. She is the youngest person to accrue six Academy Award nominations, and won the Academy Award for Best Actress for The Reader (2008).
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (109, '1981-01-28', NULL, 'Elijah Jordan Wood ( born January 28, 1981) is an American actor. He made his film debut with a minor part in Back to the Future Part II (1989), then landed a succession of larger roles that made him a critically acclaimed child actor by age 9. He is best known for his high-profile role as Frodo Baggins in Peter Jackson''s critically acclaimed The Lord of the Rings trilogy. Since then, he has resisted typecasting by choosing varied roles in critically acclaimed films such as Bobby, Eternal Sunshine of the Spotless Mind, Sin City, Green Street and Everything Is Illuminated. He starred in the film Day Zero (2007) and provided the voice of the main character, Mumble, in the award-winning animated film Happy Feet. He played an American tourist turned vampire in Paris, je t''aime. In 2005, he started his own record label, Simian Records. He was cast in the lead role of an Iggy Pop biopic to be called The Passenger, but after years of development, the project now appears to be shelved.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (103, '1967-11-22', NULL, 'Mark Alan Ruffalo (born November 22, 1967) is an American actor, director, producer and screenwriter. He has worked in films including Eternal Sunshine of the Spotless Mind, Zodiac, Shutter Island, Just Like Heaven, You Can Count on Me and The Kids Are All Right for which he received an Academy Award nomination for Best Supporting Actor.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (205, '1982-04-30', NULL, 'Kirsten Caroline Dunst (born April 30, 1982) is an American actress, singer and model. She made her film debut in Oedipus Wrecks, a short film directed by Woody Allen for the anthology New York Stories (1989). At the age of 12, Dunst gained widespread recognition playing the role of vampire Claudia in Interview with the Vampire (1994), a performance for which she was nominated for a Golden Globe Award for Best Supporting Actress. The same year she appeared in Little Women, to further acclaim. Dunst achieved international fame as a result of her portrayal of Mary Jane Watson in the Spider-Man trilogy (2002–07). Since then her films have included the romantic comedy Wimbledon (2004), the romantic science fiction Eternal Sunshine of the Spotless Mind (2004) and Cameron Crowe''s tragicomedy Elizabethtown (2005). She played the title role in Sofia Coppola''s Marie Antoinette (2006) and starred in the comedy How to Lose Friends &amp; Alienate People (2008). She won the Best Actress Award at the Cannes Film Festival in 2011 for her performance in Lars von Trier''s Melancholia.
