INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (264, '1968-07-27', NULL, 'Jorge salinas perez mejor conocido como jorge salinas es un actor mexicano nacido el 27 de julio de 1968 en la ciudad de mexico. La primera participación de Jorge en el medio del espectáculo fue en la película Viva El Chubasco, al lado de Antonio Aguilar y Eulalio González. Después, recibe dos oportunidades en televisión en 1991: la primera, en la telenovela Cadenas de amargura al lado de Daniela Castro y Raul Araiza, bajo la producción de Carlos Sotomayor; la segunda fue en Valeria y Maximiliano, protagonizada por Leticia Calderón y Juan Ferrara, también de la mano deCarlos Sotomayor. Luego aparece en la película Como Cualquier Noche, y más tarde realiza varias telenovelas, entre las que destacan El abuelo y yo yDos mujeres, un camino. Es en 1999 cuando protagoniza su primer telenovela Tres mujeres, producción de Roberto Hernandez.
