INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (270, '1956-03-05', NULL, 'Adriana Barraza (5 de marzo de 1956, Toluca - ) es una actriz mexicana nominada a los Premios de la Academia. Sus dos trabajos más importantes han sido Amores Perros y Babel. Previamente a su nominación al Oscar a la mejor actriz de reparto fue candidata en la misma categoría en los Globos de Oro y Broadcast Film Critics Association Award, y candidata al Premio del Sindicato de Actores como "Mejor actriz de reparto en una película". Es una reconocida maestra de actuación en México, Miami y Colombia. Se destacó en el Taller de Perfeccionamiento Actoral de Televisa; donde, junto al reconocido actor, director, productor, escritor y profesor de actuación: Sergio Jiménez, dio clases por más de una década. Junto a este gran teórico de la actuación compiló y diseñó un método de actuación llamado: Actuación Técnica del cual es co-creadora. (de ahí que en el medio artístico sea conocida como la querida "Maestra Barraza"). Fue actriz en algunas telenovelas y programas; además, directora de telenovelas infantiles de Televisa por muchos años, pero se ha destacado y ha alcanzado su mayor realización como maestra (de actuación, análisis de textos y neutralización de acento) y como actriz internacional de cine. En 2011 fue recortada de la cinta Thor y se entero por una carta del director que le llego a su representante', 1, 'Toluca, Estado de Mexico, Mexico', 'Adriana Barraza');
