INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (223, '1963-08-15', NULL, 'Alejandro González Iñárritu ( born August 15, 1963) is a Mexican film director. Iñárritu is the first Mexican director to be nominated for the Academy Award for Best Director and by the DGA of America for Best Director. He is also the first and only Mexican born director to have won the Prix de la mise en scene or best director award at Cannes (2006). His four feature films Amores perros (2000), 21 Grams (2003), Babel (2006) and Biutiful (2010) have gained critical acclaim worldwide including 12 Academy Award nominations.
