INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (287, '1963-12-18', NULL, 'William Bradley "Brad" Pitt (born December 18, 1963) is an American actor and film producer. Pitt has received two Academy Award nominations and four Golden Globe Award nominations, winning one. He has been described as one of the world''s most attractive men, a label for which he has received substantial media attention. Pitt began his acting career with television guest appearances, including a role on the CBS prime-time soap opera Dallas in 1987. He later gained recognition as the cowboy hitchhiker who seduces Geena Davis''s character in the 1991 road movie Thelma &amp; Louise. Pitt''s first leading roles in big-budget productions came with A River Runs Through It (1992) and Interview with the Vampire (1994). He was cast opposite Anthony Hopkins in the 1994 drama Legends of the Fall, which earned him his first Golden Globe nomination. In 1995 he gave critically acclaimed performances in the crime thriller Seven and the science fiction film 12 Monkeys, the latter securing him a Golden Globe Award for Best Supporting Actor and an Academy Award nomination.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (290, '1929-12-13', NULL, 'Arthur Christopher Orme Plummer CC (born December 13, 1929) is a Canadian theatre, film and television actor. He made his film debut in 1958''s Stage Struck, and notable film performances include The Night of the Generals, The Return of the Pink Panther, Star Trek VI: The Undiscovered Country, The Man Who Would Be King, and The Insider. In a career that spans seven decades and includes substantial roles in each of the dramatic arts, Plummer is probably best known to film audiences as the autocratic widower Captain Georg Johannes von Trapp in the hit 1965 musical film The Sound of Music alongside Julie Andrews.[1] Plummer has also ventured into various television projects, including the legendary miniseries The Thorn Birds.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (52, '1953-10-11', NULL, 'David Bowditch Morse (born October 11, 1953) is an American stage, television, and film actor. He first came to national attention as Dr. Jack Morrison in the medical drama St. Elsewhere from 1982 to 1988. Morse continued his movie career with roles in Dancer in the Dark, The Negotiator, The Green Mile, Disturbia, The Long Kiss Goodnight, The Crossing Guard, The Rock, Extreme Measures, Twelve Monkeys, 16 Blocks, and Hounddog.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (288, '1970-10-14', NULL, 'Jonathan Seda (born October 14, 1970) is an American actor of Puerto Rican descent, possibly best known for his role as Detective Paul Falsone on NBC''s: Homicide: Life on the Street. Seda was an amateur boxer who in 1992, auditioned for and was given a role in the film Gladiator. He became interested in acting and appeared in various films. He portrayed Chris Pérez alongside Jennifer Lopez in Selena and became widely known to both the Hispanic and non-Hispanic communities. He continues to act and has had numerous television appearances, and recently appeared as legendary Marine John Basilone in Tom Hanks and Steven Spielberg''s follow up to Band of Brothers, The Pacific. Seda currently stars in the HBO series, Treme.', 2, 'Manhattan - New York City - New York - USA', 'Jon Seda');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (291, '1933-04-05', '2005-05-17', 'Frank John Gorshin, Jr. (April 5, 1933 – May 17, 2005) was an American actor and comedian. He was perhaps best known as an impressionist, with many guest appearances on The Ed Sullivan Show and The Tonight Show (with host Steve Allen). His most famous acting role was as The Riddler in the Batman live action television series. Description above from the Wikipedia article Frank Gorshin, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 0, 'Pittsburgh - Pennsylvania - USA', 'Frank Gorshin');
