INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (73421, '1974-10-28', NULL, 'American film actor Joaquin Rafael Phoenix, born Joaquin Rafael Bottom has ventured behind the camera, directing music videos as well as producing movies and television shows. Phoenix recorded an album, the soundtrack to “Walk the Line”. He is also known for his work as a social activist, particularly as an advocate for animal rights. Phoenix''s first acting jobs were guest appearances on two television shows with his brother River in Seven Brides for Seven Brothers (1982) and Backwards: The Riddle Of Dyslexia (1984). He made his big-screen debut in Space Camp (1986), playing the role of Max, after starring in an Alfred Hitchcock Presents episode "A very happy ending" the same year. His first starring role was in Russkies (1987). He later co-starred in Ron Howard''s Parenthood (1989), in which he was credited as Leaf Phoenix.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (368, '1976-03-22', NULL, '​Laura Jeanne Reese Witherspoon (born March 22, 1976), better known as Reese Witherspoon, is an American actress and film producer. Witherspoon landed her first feature role as the female lead in the movie The Man in the Moon in 1991; later that year she made her television acting debut, in the cable movie Wildflower. In 1996, Witherspoon appeared in Freeway and followed that appearance with roles in three major 1998 movies: Overnight Delivery, Pleasantville, and Twilight. The following year, Witherspoon appeared in the critically acclaimed Election, which earned her a Golden Globe nomination.2001 marked her career''s turning point with the breakout role as "Elle Woods" in the box office hit Legally Blonde, and in 2002 she starred in Sweet Home Alabama, which became her biggest commercial film success to date. 2003 saw her return as lead actress and executive producer of Legally Blonde 2: Red, White &amp; Blonde. In 2005, Witherspoon received worldwide attention and praise for her portrayal of June Carter Cash in Walk the Line, which earned her an Academy Award, Golden Globe, BAFTA, and Screen Actors Guild Award for Best Actress in a Leading Role.
