INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (587, '1947-02-24', NULL, 'Edward James Olmos (born February 24, 1947) is a Mexican American actor and director. Among his most memorable roles are William Adama in the re-imagined Battlestar Galactica, Lt. Martin Castillo in Miami Vice, teacher Jaime Escalante in Stand and Deliver, patriarch Abraham Quintanilla in the film Selena, Detective Gaff in Blade Runner, and narrator El Pachuco in both the stage and film versions of Zoot Suit. Description above from the Wikipedia article Edward James Olmos, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'Los Angeles, California, U.S.', 'Edward James Olmos');
