INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (879, '1955-08-04', NULL, 'Billy Bob Thornton (born August 4, 1955) is an American actor, screenwriter, director and musician. Thornton gained early recognition as a cast member on the CBS sitcom Hearts Afire and in several early 1990s films including On Deadly Ground and Tombstone. In the mid-1990s, after writing, directing, and starring in the independent film Sling Blade, he won an Academy Award for Best Adapted Screenplay. He appeared in several major film roles following Sling Blade ''s success, including 1998''s Armageddon and A Simple Plan. During the late 1990s, Thornton began a career as a singer-songwriter. He has released three albums and was the singer of a blues rock band.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (887, '1968-11-18', NULL, 'Owen Cunningham Wilson (born November 18, 1968) is an American actor and screenwriter from Dallas, Texas. His older brother, Andrew and younger brother, Luke, are also actors. He has had a long association with filmmaker Wes Anderson, having shared co-writing and acting credits for Bottle Rocket (1996) and The Royal Tenenbaums (2001), which was nominated for an Academy Award for Best Original Screenplay, and for his collaborations with fellow actor Ben Stiller. The two have appeared in ten films together.
