INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (880, '1972-08-15', NULL, 'Ben Affleck (born Benjamin Géza Affleck-Boldt; August 15, 1972) is an American actor, film director, writer, and producer. He became known in the mid-1990s with his performance in the Kevin Smith films Mallrats (1995) and Chasing Amy (1997). Affleck is an Academy Award as well as a Golden Globe Award winner, along with Matt Damon, for their collaborative screenplay for the 1997 film Good Will Hunting. He established himself as a Hollywood leading man, having starred in several big budget films, such as Armageddon (1998), Pearl Harbor (2001), Changing Lanes (2002), The Sum of All Fears (2002), and Daredevil (2003).
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (882, '1977-07-01', NULL, 'Liv Rundgren Tyler is an American actress and model. She is the daughter of Aerosmith''s lead singer, Steven Tyler, and Bebe Buell, model and singer. Tyler began a career in modeling at the age of 14, but after less than a year she decided to focus on acting. She made her film debut in the 1994 film Silent Fall. She then appeared in supporting roles in Empire Records (1995), Heavy (1996), and That Thing You Do! (1996). Tyler later achieved critical recognition in the leading role Stealing Beauty (1996). She followed this by starring in supporting roles including Inventing the Abbotts (1997) and Cookie''s Fortune (1999).
