INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (884, '1957-12-13', NULL, 'Steven Vincent "Steve" Buscemi is an American actor, writer and film director. He was born in Brooklyn, New York, the son of Dorothy, who worked as a hostess at Howard Johnson''s, and John Buscemi, a sanitation worker and Korean War veteran. Buscemi''s father was Sicilian American and his mother Irish American. He has three brothers: Jon, Ken, and Michael. Buscemi was raised Roman Catholic.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (886, '1956-11-27', NULL, 'William Edward Fichtner (born November 27, 1956) is an American actor. He has appeared in a number of notable film and TV series. He is known for his roles as Sheriff Tom Underlay in the cult favorite television series Invasion, Alexander Mahone on Prison Break and Butch Cavendish in The Lone Ranger.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (61981, '1957-12-10', '2012-09-03', 'Michael Clarke Duncan was born December 10, 1957 in Chicago, Illinois He is best known for his breakout role as John Coffey in The Green Mile.  In 1998, Duncan was cast as Bear in the film Armageddon, where he struck up a friendship with castmate Bruce Willis. It was Bruce Willis'' influence that helped him to get his breakout role as John Coffey in the Frank Darabont-directed The Green Mile, a role which netted him an Academy Award nomination for Best Actor in a Supporting Role and a Golden Globe nomination for Best Performance by an Actor in a Supporting Role in a Motion Picture.  Duncan then was cast in a string of films that helped to establish him as a star: The Whole Nine Yards, Planet of the Apes, The Scorpion King (where he starred alongside his friend, The Rock), The Island and Daredevil as Wilson Fisk, aka The Kingpin.    Duncan has also provided his voice for a number of roles including Brother Bear, The Land Before Time XI: Invasion of the Tinysauruses, Quiznos commercials, and the video games Demon Stone, SOCOM II: U.S. Navy SEALs, The Suffering: Ties That Bind, Saints Row, and Soldier of Fortune, with his most recent role being God of War II, where he provides the voice of Atlas, the Titan condemned by Zeus to stand at the western edge of the earth and hold up the sky on his shoulders. He later reprised his role as the Kingpin in Spider-Man: The New Animated Series.  In 2005, he starred in the film Sin City (again alongside Bruce Willis) as Manute, a powerful mobster. Duncan appeared in a minor role in the 2006 movie Talladega Nights: The Ballad of Ricky Bobby as Lucius Washington, and he voiced the role of the villain Massive in the Loonatics Unleashed.  In 2006, he voiced the role of Numbuh 26 in the animated movie Codename: Kids Next Door: Operation ZERO. He played Balrog in Street Fighter: The Legend of Chun-Li and voiced the prison commander in Kung Fu Panda.  In 2011, Duncan plays ‘The Giant Troll’ in the fantasy comedy film, Your Highness and will reprise his role in the SinCity sequels.  On September 3 2012 Michael Clarke Duncan passed away from complications after a massive heart attack on July 13th 2012.', 2, 'Chicago, Illinois, USA', 'Michael Clarke Duncan');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (53, '1953-08-27', NULL, 'Peter Stormare (born Rolf Peter Ingvar Storm; 27 August 1953) is a Swedish film, stage, voice and television actor as well as a theatrical director, playwright and musician. He is perhaps best known for his roles as John Abruzzi in Prison Break and as Gaear Grimsrud, one of the two kidnappers in Fargo.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (42707, '1965-12-19', NULL, 'Jessica Steen (born December 19, 1965) is a film and television actress, noted for her roles in Captain Power and the Soldiers of the Future, Homefront, Earth 2, Armageddon, Left Behind: World at War, NCIS, and Flashpoint.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (8191, '1956-04-14', NULL, 'Chris Ellis is an American film and television actor who was born April 14, 1956 in Dallas, Texas. Ellis always wanted to be an actor because of television. He grew up in the 50''s in the deep south in a "world of privation and violence", but saw on television people who seemed to have lives of ease and privilege.
