INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (65827, '1956-06-04', NULL, 'Keith David Williams (born June 4, 1956), better known as Keith David, is an American film, television, and voice actor, and singer. He is perhaps most known for his live-action roles in such films as Crash, There''s Something About Mary, Barbershop and Men at Work. He has also had memorable roles in numerous cult favorites, including John Carpenter''s films The Thing (as Childs) and They Live (as Armitage), the Riddick films Pitch Black and The Chronicles of Riddick (as the Imam), the General in Armageddon, King in Oliver Stone''s Platoon, and Big Tim in Darren Aronofsky''s Requiem for a Dream. David is also well known for his voice over career, primarily his Emmy winning work as the narrator of numerous Ken Burns films. Characters that he has voiced include Goliath on the Disney series Gargoyles, the Arbiter in Halo 2 and Halo 3, David Anderson in Mass Effect and Mass Effect 2, the Decepticon Barricade in Transformers: The Game, Julius Little in Saints Row and Saints Row 2, Sgt. Foley in Call of Duty: Modern Warfare 2, Dr. Facilier in The Princess and the Frog, and Chaos in Dissidia: Final Fantasy and Dissidia 012 Final Fantasy.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (11355, '1963-06-06', NULL, 'Jason Isaacs is an English actor born in Liverpool, who is most well known for his performance as the villain Lucius Malfoy in the Harry Potter films, the brutal Colonel William Tavington in The Patriot and as lifelong criminal Michael Caffee in the internationally-broadcast American television series Brotherhood.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (63941, NULL, NULL, 'Marshall R. Teague (born April 1953) is an American film and television actor. He is known for his role in the 1989 cult movie Road House and for his recurring role on the 1990s hit science fiction series Babylon 5 as a Narn named Ta''Lon. Teague has also starred in the 1996 film The Rock and the 1998 movie Armageddon.
