INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1043304, '1969-08-16', NULL, 'Andy Milder was born in August 1969 in Omaha, Nebraska, United States.  Young lived in Santa Monica, California and after completing the  secondary attended to the University of Berkeley, California, where he  studied economics before studying at the American Conservatory Theater  in San Francisco. She debuted in film in 1991, in the musical comedy  starring Bette Midler and James Caan, "Yesterday, today and forever".  Since then, could v rselo in feature films such as "Learning to live"  (1994), "I like the trouble" (1994), "Apollo 13" (1995), "Armageddon"  (1998), "Domino" (2005), "Dicen por Ahi" (2005), "Transformers" (2007),  "Frost/Nixon" (2008), or "Seven Pounds" (2008). On television, Milder  Marcus Carilli, played in the 1998 series, "Fame L.A.", and was guest  artist in numerous programmes from the beginning of his career as  "Married with Children", "From the Earth to the Moon", "Star Trek:  Voyager", "Dharma &amp; Greg," "The West Wing", "Boston Legal", "House",  "CSI: New York", "Medium", "Six Feet Under", "Ugly Betty" and "without  an appointment (Private Practice)", among others. He currently plays  Dean Hodes, Showtime "Weeds" series. Milder is also a "voice artist",  and his voice was narrated that, among other programs "Ballroom  Bootcamp", "101 Most Starlicious Make-Overs", and "Wrecks to Riches".  Was also the voice of Lightning Lad in the animated series of 2006,  "Legion of Super Heroes"; and she also played innumerable characters for  video games. Milder lives in Manhattan Beach, California with his wife,  Dr. Betty Lee.', 2, 'Omaha - Nebraska - USA', 'Andy Milder');
