INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (225004, '1962-10-05', NULL, 'Joseph Malerba est un acteur français né le 5 octobre 1962 à Paris. Joseph Malerba était élève au Cours Florent de 1987 à 1990. C''est Isabelle Nanty qui le fait débuter au théâtre en1991. Elle va le diriger dans La Ronde, puis dans La Mouette. En 1995 commence une collaboration avec le metteur en scène Roger Planchon. En 1997 et 1998, il participe au Centre de visionnage sur Canal+, aux côtés d''Édouard Baer. Dès la fin des années 1990, Joseph Malerba devient également un solide second rôle, au cinéma et à la télévision. Il parle également italien.', 2, 'Paris - France', 'Joseph Malerba');
