INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1158, '1940-04-25', NULL, 'Alfredo James "Al" Pacino (born April 25, 1940) is an American film and stage actor and director. He is famous for playing mobsters, including Michael Corleone in The Godfather trilogy, Tony Montana in Scarface, Alphonse "Big Boy" Caprice in Dick Tracy and Carlito Brigante in Carlito''s Way, though he has also appeared several times on the other side of the law — as a police officer, detective and a lawyer. His role as Frank Slade in Scent of a Woman won him the Academy Award for Best Actor in 1992 after receiving seven previous Oscar nominations.
