INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (110, '1958-10-20', NULL, 'Viggo Peter Mortensen, Jr. (born October 20, 1958) is an American-Danish actor, poet, musician, photographer and painter. He made his film debut in Peter Weir''s 1985 thriller Witness, and subsequently appeared in many notable films of the 1990s, including The Indian Runner (1991), Carlito''s Way (1993), Crimson Tide (1995), The Portrait of a Lady (1996), G.I. Jane (1997), A Perfect Murder (1998), and A Walk on the Moon (1999).
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (114, '1977-01-13', NULL, 'Orlando Jonathan Blanchard Bloom is an English actor. He had his break-through roles in 2001 as the elf-prince Legolas in The Lord of the Rings and starting in 2003 as blacksmith Will Turner in the Pirates of the Caribbean trilogy of films, and subsequently established himself as a lead in Hollywood films, including Elizabethtown and Kingdom of Heaven. He appeared in the ensemble film New York, I Love You, and will have roles in Sympathy for Delicious and Main Street. Bloom made his professional stage debut in West End''s In Celebration at the Duke of York''s Theatre, St. Martin''s Lane, which ended its run on 15 September 2007.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (335, '1974-08-07', NULL, 'Michael Corbett Shannon (born August 15, 1974) is an American stage, film, and television actor. He was nominated for the Academy Award for Best Supporting Actor for his role in Revolutionary Road and was a series regular on the critically acclaimed Boardwalk Empire.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (655, '1944-05-05', NULL, '​From Wikipedia, the free encyclopedia.   John Rhys-Davies (born 5 May 1944) is a Welsh actor and vocal artist. He is perhaps best known for playing the charismatic Arab excavator Sallah in the Indiana Jones films and the dwarf Gimli in The Lord of the Rings trilogy, in which he also voiced the ent, Treebeard. He also played Agent Michael Malone in the 1993 remake of the 1950s television series The Untouchables, Professor Maximillian Arturo in Sliders, King Richard I in Robin of Sherwood, General Leonid Pushkin in the James Bond film The Living Daylights, and Macro in I, Claudius. Additionally, he provided the voices of Cassim in Disney''s Aladdin and the King of Thieves, Man Ray in SpongeBob SquarePants, and Tobias in the computer game Freelancer. He is also the narrator for the TV show Wildboyz. Description above from the Wikipedia article  John Rhys-Davies, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'Ammanford, Carmarthenshire, Wales, United Kingdom', 'John Rhys-Davies');
