INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (112, '1969-05-14', NULL, 'Catherine Élise "Cate" Blanchett (born 14 May 1969) is an Australian  actress and theatre director. She has won multiple acting awards, most  notably two SAGs, two Golden Globe Awards, two BAFTAs, and an Academy  Award, as well as the Volpi Cup at the 64th Venice International Film  Festival. Blanchett earned five Academy Award nominations between 1998  and 2007.  Blanchett came to international attention for her role as Elizabeth I of  England in the 1998 film Elizabeth, directed by Shekhar Kapur. She is  also well-known for her portrayals of the elf queen Galadriel in Peter  Jackson''s The Lord of the Rings trilogy and the upcoming The Hobbit,  Colonel-Doctor Irina Spalko in Indiana Jones and the Kingdom of the  Crystal Skull and Katharine Hepburn in Martin Scorsese''s The Aviator, a  role which brought her an Academy Award for Best Supporting Actress. She  and her husband Andrew Upton are currently artistic directors of the  Sydney Theatre Company.  Description above from the Wikipedia article Cate Blanchett, licensed  under CC-BY-SA, full list of contributors on Wikipedia.', 1, 'Melbourne, Victoria, Australia', 'Cate Blanchett');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1524, '1944-11-21', '2014-02-24', 'Harold Allen Ramis is an American actor, director, and writer, specializing in comedy. His best-known film acting roles are as Egon Spengler in Ghostbusters (1984) and Russell Ziskey in Stripes (1981), both of which he co-wrote. As a writer/director, his films include the comedies Caddyshack (1980), Groundhog Day (1993), and Analyze This (1999). Ramis was the original head writer of the television series SCTV (in which he also performed), and one of three screenwriters for the film National Lampoon''s Animal House (1978).', 2, 'Chicago, Illinois, USA', 'Harold Ramis');
