INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1620, '1962-08-06', NULL, 'Michelle Yeoh Choo-Kheng (born 6 August 1962) is a Hong Kong-based Malaysian actress and dancer, well known for performing her own stunts in the action films that brought her to fame in the early 1990s.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1339, '1979-02-09', NULL, 'Zhang Ziyi, sometimes credited as Ziyi Zhang, is a Chinese film actress and model. She is considered one of the Four Dan Actresses of China. Her first major role was in The Road Home (1999). She achieved fame in the West after leading roles in Crouching Tiger, Hidden Dragon (2000), Rush Hour 2 (2001), House of Flying Daggers (2004), 2046 (2004), and Memoirs of a Geisha (2005). She has been nominated for three BAFTA Awards and a Golden Globe Award.', 1, 'Beijing - China', 'Zhang Ziyi');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1622, '1976-10-14', NULL, 'Chang Chen (born October 14, 1976) is a Taiwanese actor, born in Taipei, Taiwan. His name is sometimes seen in the Western order (Chen Chang). He is the son of a Taiwanese actor Chang Kuo Chu and brother of a Taiwanese actor, Chang Ha', 0, 'Taipei, Taiwan', 'Chang Chen');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1624, '1946-12-04', NULL, 'Cheng Pei-Pei (simplified Chinese: 郑佩佩; traditional Chinese: 鄭佩佩; Mandarin Pinyin: Zhèng Pèipèi; Jyutping: Cheng6 Pui3 Pui3; born 4 December 1946 in Shanghai) is an actress best known for her performance in the seminal 1966 King Hu wuxia film Come Drink with Me. She continued to play expert swordswomen in a number of films throughout the 1960s. In 2000, she returned to international attention with her role as Jade Fox in Ang Lee''s Crouching Tiger Hidden Dragon (which also marked the first time that she had been cast in a villain role in a martial arts film). She followed this up with her portrayal of Long Po in the 2004 television miniseries Watery Moon, Hollow Sky, which was shown on Asian-American television as Paradise. She continues to work for Zhouyi Media in mainland China.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (677, '1971-08-13', NULL, 'Moritz Bleibtreu (born August 13, 1971) is a German actor. Bleibtreu was born in Munich, the son of actors Monica Bleibtreu and Hans Brenner, and the great-grand-nephew of the actress Hedwig Bleibtreu. Bleibtreu grew up in Hamburg. His first appearance on TV was in the late seventies on a children''s television series called Neues aus Uhlenbusch, written by his mother Monica and Rainer Boldt. This was followed by a role in Boldt''s Ich hatte einen Traum and alongside his mother in the miniseries Mit meinen heißen Tränen. After he left school when he was 16, he lived in Paris and New York City where he attended acting school. In 1992 he began his acting career at the Schauspielhaus in Hamburg. He also had numerous small parts in television productions. His roles include the Gray Ghost in the film Speed Racer, Andreas Baader in The Baader Meinhof Complex, Manni in Run Lola Run, and Tarek Fahd in the psychological thriller Das Experiment.
