INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1979, '1959-07-26', NULL, 'Kevin Spacey Fowler (born July 26, 1959), better known by his stage name Kevin Spacey, is an American actor of screen and stage, film director, producer, screenwriter and singer who has resided in the United Kingdom since 2003. He began his career as a stage actor during the 1980s before obtaining supporting roles in film and television. He gained critical acclaim in the early 1990s that culminated in his first Academy Award for Best Supporting Actor for the neo-noir crime thriller The Usual Suspects (1995), and an Academy Award for Best Actor for midlife crisis-themed drama American Beauty (1999).
