INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (101847, '1955-07-13', NULL, 'Lance E. Nichols (born July 13, 1955) is an American actor from New Orleans, Louisiana, best known for playing dentist Larry Williams on Treme. A graduate of McDonogh 35 High School and the University of New Orleans, he is also known for his roles in The Curious Case of Benjamin Button and House of Cards and is a frequent presence in films that were made in the city. In 2012 he appeared as a character similar to his Treme character, and also named "Larry", in a commercial for Chase Bank that also featured Drew Brees and his family and was aired during the broadcast of Super Bowl XLVI.', 2, 'New Orleans, Louisiana, USA', 'Lance E. Nichols');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1978, '1956-11-30', NULL, 'From Wikipedia, the free encyclopedia  Iain Softley (born November 30, 1956) is an English film director. He was educated at St Benedict''s School, Ealing, where he played the part of Thomas Becket in its 1975 production of T. S. Eliot''s play, Murder in the Cathedral, and Queens'' College, Cambridge.  His movies include the Beatles film Backbeat (1994), Hackers (1995), The Wings of the Dove (1997), K-PAX (2001), The Skeleton Key (2005) and Inkheart (2008). Softley also has been developing an adaptation of Stephen Gallagher''s novel The Boat House for Dimension Films, set in the English Lake District. He previously attempted to film the book in 1999, with Milla Jovovich in the lead role of a haunted and driven Russian émigré.  Description above from the Wikipedia article Iain Softley, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 0, 'London, England, UK', 'Iain Softley');
