INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2148, '1963-06-28', NULL, 'Charles Alexander Clouser (born June 28, 1963 in Hanover, New Hampshire) is a former Nine Inch Nails band member whose activities include playing drums and keyboard, engineering, mixing and music programming. Clouser was a member of NIN from 1994-2000 and was part of the live band on the Self Destruct and Fragility tours, as well as collaborating with Trent Reznor in the studio on various projects. One such collaboration being the Natural Born Killers soundtrack on which he aided in recording and producing a new version of "Something I Can Never Have." His work can also be heard on releases such asFurther Down the Spiral and Things Falling Apart. Clouser has also done remixes for various bands, including: White Zombie,Marilyn Manson, Rammstein, Prong, Killing Joke, Type O Negative, Zilch, Schwein, Collide, 12 Rounds, Foetus, Meat Beat Manifesto and Esthero.
