INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (694, '1924-04-14', '2003-06-15', 'From Wikipedia, the free encyclopedia  Philip Stone (14 April 1924 – 15 June 2003) was an English actor.  He was born Philip Stones in Leeds, West Riding of Yorkshire. Stone appeared in three successive Stanley Kubrick films: playing the central character Alex''s "Dad" in A Clockwork Orange (1971), "Graham" (the Lyndon family lawyer) in Barry Lyndon (1975) and as "Delbert Grady," the original caretaker in The Shining (1980). The only other actor to be credited in three Kubrick films is Joe Turkel.  Other notable film roles included parts in Unearthly Stranger (1964),Thunderball (1965), Where Eagles Dare (1968), Two Gentlemen Sharing(1969), Fragment of Fear (1970), Quest for Love (1971), Carry On Loving(1971), O Lucky Man! (1973), Hitler: The Last Ten Days (1973), Voyage of the Damned (1976), It Shouldn''t Happen to a Vet (1977), The Medusa Touch (1978),S.O.S. Titanic (1979), Flash Gordon (1980), Green Ice (1981), Indiana Jones and the Temple of Doom (1984) and Shadowlands (1985). In the 1978 Ralph Bakshi''s animated film The Lord of the Rings, he voiced the role of Théoden.  Stone was also a prolific stage and television actor, appearing in many popular TV series, including the very first Avengers episode, The Rat Catchers, Dalziel and Pascoe, A Touch of Frost, Heartbeat, Yes Minister, Justice and Coronation Street.', 0, 'Kirkstall - Leeds - West Yorkshire - England - UK', 'Philip Stone');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (240, '1928-07-26', '1999-03-07', 'Stanley Kubrick (July 26, 1928 – March 7, 1999) was an American film director, writer, producer, and photographer who lived in England during most of the last four decades of his career. Kubrick was noted for the scrupulous care with which he chose his subjects, his slow method of working, the variety of genres he worked in, his technical perfectionism, and his reclusiveness about his films and personal life. He maintained almost complete artistic control, making movies according to his own whims and time constraints, but with the rare advantage of big-studio financial support for all his endeavors. Kubrick''s films are characterized by a formal visual style and meticulous attention to detail—his later films often have elements of surrealism and expressionism that eschews structured linear narrative. His films are repeatedly described as slow and methodical, and are often perceived as a reflection of his obsessive and perfectionist nature. A recurring theme in his films is man''s inhumanity to man. While often viewed as expressing an ironic pessimism, a few critics feel his films contain a cautious optimism when viewed more carefully.
