INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1896, '1964-11-29', NULL, 'Donald Frank "Don" Cheadle, Jr. was on born November 29, 1964 in Kansas City, Missouri. He is an American film actor as well as producer. Cheadle first received widespread notice for his portrayal of Mouse Alexander in the film Devil in a Blue Dress, for which he won Best Supporting Actor awards from the Los Angeles Film Critics Association and the National Society of Film Critics and was nominated for similar awards from the Screen Actors Guild and the NAACP Image Awards.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2598, '1969-01-01', NULL, 'Sophie Okonedo, OBE (born 1968) is a British actress and singer, who has starred in both successful British and American productions. In 1991, she made her acting debut in the British critically acclaimed coming-of-age drama, Young Soul Rebels. In 2004, she gained critical acclaim for her role as Tatiana Rusesabagina, the wife of Rwandan hotel manager Paul Rusesabagina in the genocide drama film Hotel Rwanda (2004). Her role earned her an Academy Award nomination for Best Actress in a Supporting Role.
