INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2819, '1924-12-04', '1998-03-25', 'Pracę artystyczną rozpoczął w czasach okupacji jako aktor-amator. W  latach 1948-1952 występował w Teatrze Kolejarza w Krakowie. Od 1953  związany z Teatrem im. Wandy Siemaszkowej w Rzeszowie.  Stworzył tu wiele wybitnych kreacji aktorskich, m.in. Cześnika w  "Zemście", Majora w "Fantazym", Wojewody w "Mazepie" czy Czepca w  "Weselu". W latach 1972-1982 pracował w Teatrze Polskim i Współczesnym we Wrocławiu. Od 1983 ponownie występował w Rzeszowie.
