INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3033, '1972-07-29', NULL, 'Richard William "Wil" Wheaton III (born July 29, 1972) is an American actor and writer. As an actor, he is best known for his portrayals of Wesley Crusher on the television series Star Trek: The Next Generation, Gordie LaChance in the film Stand by Me and Joey Trotta in Toy Soldiers. As a writer, he is best known for his blog, Wil Wheaton Dot Net.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (741, '1970-08-23', '1993-10-31', 'River Phoenix was an up-and-coming movie star when he died suddenly of drug-induced heart failure in 1993 at the age of 23. His brief career was marked by critically-acclaimed performances in films such as Stand By Me (1986), Running On Empty (1988) and Gus Van Sant''s My Own Private Idaho (1991, with Keanu Reeves).  River was the eldest of five children whose itinerant parents were members of a radical Christian group called the Children of God (later known as The Family). His family lived in communes in Oregon, Texas, Puerto Rico and Venezuela before settling in Florida.  Pursuing entertainment careers for their children, the parents moved the family to Los Angeles, where River began getting television jobs in the early 1980s. Although his first feature film was 1985''s Explorers (with young Ethan Hawke), it was his stand-out performance in the ensemble drama Stand By Me that gained him national recognition. Phoenix was labeled a promising young actor and his career took off. He co-starred with Harrison Ford in both The Mosquito Coast (1986) and Indiana Jones and the Last Crusade (1989), and earned an Oscar nomination for his performance in Running On Empty. His other films include Little Nikita (1988, with Sidney Poitier), Dogfight (1991) and Sneakers (1992, with Robert Redford).
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3034, '1971-07-16', NULL, 'Corey Scott Feldman (July 16, 1971) is an American film and television actor. He became known during the 1980s, with roles in the Hollywood films Friday the 13th: The Final Chapter, The Goonies, Stand by Me, The Lost Boys, License to Drive, Dream a Little Dream, Gremlins and Teenage Mutant Ninja Turtles.
