INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3039, '1966-11-08', NULL, 'Bradley Gregg is an American actor, director, writer, and producer. Gregg''s first film was the 1985 movie Explorers, but his big role came in 1986 in the hit drama film Stand by Me as Eyeball Chambers, the older brother of River Phoenix''s character (Gregg and Phoenix had both appeared previously in Explorers). In 1987, Gregg starred in the hit horror film A Nightmare on Elm Street 3: Dream Warriors as Phillip Anderson.
