INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2983, '1963-08-05', NULL, 'British actor Mark Strong, who played Jim Prideaux in the 2011 remake of Tinker Tailor Soldier Spy (2011), is often cast as cold, calculating villains. But before he became a famous actor, he intended to pursue a career in law. Strong was born Marco Giuseppe Salussolia on 30 August, 1963 in London, England, to an Austrian mother and an Italian father. His father left the family not long after he was born, and his mother worked as an au pair to raise the boy on her own. Strong''s mother had his name legally changed when he was young in order to help him better assimilate with his peers. Although Americans are most familiar with Strong''s roles as Sinestro in Green Lantern (2011), mob boss Frank D''Amico in Kick-Ass (2010), and Lord Blackthorn in Sherlock Holmes (2009), British audiences know him from his long history as a television actor. He also starred in as numerous British stage productions, including plays at the Royal National Theatre and the RSC.  His most prominent television parts include Prime Suspect 3 (1993) (TV) and Prime Suspect 6: The Last Witness (2003) (TV) as Inspector Larry Hall, and starring roles in the BBC Two dramas "Our Friends in the North" (1996) and "The Long Firm" (2004), the latter of which netted Strong a BAFTA nomination. He also played Mr. Knightley in the 1996 adaptation of Jane Austen''s classic tale Emma (1996) (TV). Strong resides in London with his wife Liza Marshall, with whom he has two sons, the younger of which is the godson of his longtime friend Daniel Craig.', 2, 'London, England, UK', 'Mark Strong');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (82639, '1986-02-19', NULL, 'Ophelia had a part in the John Lennon biopic Nowhere Boy as well as the TV series FM. She played a leading role in the film 4.3.2.1 as Shannon and had roles in the 2011 films London Boulevard, No Strings Attached and Mr Popper''s Pengiuns.', 1, 'London,  England', 'Ophelia Lovibond');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3556, '1933-08-18', NULL, 'Roman Polanski (born 18 August 1933) is a Polish-French film director, producer, writer and actor. Born in Paris to Polish parents, Polanski relocated with his family to Poland in 1937. After surviving the Holocaust, he continued his education in Poland and became a critically acclaimed director of both art house and commercial films. Polanski''s first feature-length film, Knife in the Water (1962), made in Poland, was nominated for an Academy Award for Best Foreign Language Film. He has since received five more Oscar nominations, and in 2002 received the Academy Award for Best Director for his film, The Pianist. He has also been the recipient of two Baftas, four Césars, a Golden Globe and the Palme d''Or. He left Poland in 1961 to live in France for several years, then moved to the United Kingdom where he collaborated with Gérard Brach on three films, beginning with Repulsion (1965). In 1968 he moved to the United States, immediately cementing his burgeoning directing status with the 1968 groundbreaking Academy Award winning horror film Rosemary''s Baby.
