INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (504, '1958-10-16', NULL, '​Timothy Francis "Tim" Robbins (born October 16, 1958) is an American actor, screenwriter, director, producer, activist and musician. He is the former longtime partner of actress Susan Sarandon. He is known for his roles as Nuke in Bull Durham, Andy Dufresne in The Shawshank Redemption, and as Dave Boyle in Mystic River, for which he won an Academy Award for Best Supporting Actor.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (192, '1937-06-01', NULL, 'Morgan Porterfield Freeman, Jr. is an American actor, film director, and narrator. He is noted for his reserved demeanor and authoritative speaking voice. Freeman has received Academy Award nominations for his performances in Street Smart, Driving Miss Daisy, The Shawshank Redemption and Invictus and won in 2005 for Million Dollar Baby. He has also won a Golden Globe Award and a Screen Actors Guild Award.
