INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (6574, '1959-01-05', NULL, 'Clarence J. "Clancy" Brown III (born January 5, 1959 height 6'' 3½" (1,92 m)) is an American film, television and voice actor. He is known for his live-action roles as Captain Byron Hadley in the award-winning The Shawshank Redemption; The Kurgan in the film Highlander; Brother Justin Crowe in HBO''s critically acclaimed Carnivàle and Career Sergeant Zim in Starship Troopers. Brown is most famous for providing the voices of animated characters such as Mr. Eugene H. Krabs in the animated series SpongeBob SquarePants; Lex Luthor throughout various DC projects; Captain Black and Ratso in Jackie Chan Adventures; Otto in Super Robot Monkey Team Hyperforce Go!; Dr. Neo Cortex in the original Crash Bandicoot video games and Savage Opress in Star Wars: The Clone Wars. Early life
