INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (6579, '1949-04-08', NULL, 'After college graduation, Delate moved to New York City and spent his first few years adapting, both professionally and personally, to the novelty and pace of the city. Delate''s first professional acting work (and his very special association with the New York Shakespeare Festival) began in 1981, when he was cast in both of the plays performed in Central Park that summer - Henry IV, Part I and The Tempest. Other plays followed (including Joseph Papp''s Hamlet with Diane Venora), and in 1984-1985, Delate received critical acclaim for his performance in the award-winning play, Tracers, which had successful runs in both New York (NYSF) and London (Royal Court). An abundance of daytime television and commercial work followed. In 1987, William Friedkin cast him in Python Wolf and not long after, David Jones cast him opposite Robert DeNiro and Ed Harris in Jacknife. Theatre, film and television opportunities all combined to help Delate thrive as an actor. He spent three seasons with the River Arts Repertory, and three seasons with Phoenix Theatre Company doing rotating repertory theatre, along with numerous theatre acting stints in and out of New York. One piece of trivia from that time was that Delate got to play the Humphrey Bogart role of Rick in the only sanctioned stage production of Casablanca permitted by Warner Brothers.  Delate has had the privilege to work with some of the most talented and creative directors and actors in the industry -- most recently in The Brave One (directed by Neil Jordan, with Jodie Foster), in Salome on Broadway, directed by Estelle Parsons and elsewhere and in the film, Salomaybe (both with Al Pacino), as well as in My Brother (directed by Anthony Lover), Buffalo Soldiers (directed by Gregor Jordan, with Ed Harris and Joaquin Phoenix), The Truman Show (directed by Peter Weir, with Jim Carrey and Laura Linney), American Wake and Home Before Dark (both directed by Maureen Foley, the latter with Katherine Ross), Sudden Death (directed by Peter Hyams), Far From Heaven (directed by Todd Haynes), Ash Wednesday (directed by Edward Burns), and The Shawshank Redemption (directed by Frank Darabont, with Tim Robbins).', 0, 'Trenton, New Jersey, USA', 'Brian Delate');
