INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (116, '1985-03-26', NULL, 'Keira Christina Knightley (born 26 March 1985) is an English actress and model. She began acting as a child and came to international prominence in 2002 after co-starring in the films Bend It Like Beckham and Pirates of the Caribbean: The Curse of the Black Pearl. Knightley has appeared in several Hollywood films and earned nominations for the Academy Award for Best Actress and Golden Globe Award for Best Actress for her role as Elizabeth Bennet in Joe Wright''s 2005 adaptation of Jane Austen''s novel Pride and Prejudice. Two years later she again was nominated for the Golden Globe Award for Best Actress, as well as the BAFTA Award for Best Actress in a Leading Role for her performance in Atonement. In 2008, Forbes claimed Knightley to be the second highest paid actress in Hollywood, having reportedly earned $32 million in 2007, making her the only non-American on the list of highest paid actresses.', 1, 'London, England', 'Keira Knightley');
