INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2449, '1956-04-27', NULL, 'Kevin McNally was born on April 27, 1956, in Bristol, England. He grew up in Birmingham where he attended Redhill and Mapledene Junior schools and Central Grammar School for Boys. At the age of 16, he got his first job at Birmingham Repertory Theatre. A year later he received a scholarship to the Royal Academy of Dramatic Art. In 1975 he won the Best Actor Bancroft Gold Medal for his stage performance. McNally''s most notable stage performances in London''s West End include his appearance as Alan Bennett opposite Maggie Smith in ''The Lady in the Van'' and opposite Juliette Binoche in ''Naked''. He also starred as Richard in Terry Johnson''s ''Dead Funny'' at the Savoy Theatre.
