INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1100, '1947-07-30', NULL, 'Arnold Alois Schwarzenegger (born July 30, 1947) is an Austrian-American former professional bodybuilder, actor, model, businessman and politician who served as the 38th Governor of California (2003–2011). Schwarzenegger began weight training at 15. He was awarded the title of Mr. Universe at age 20 and went on to win the Mr. Olympia contest a total of seven times. Schwarzenegger has remained a prominent presence in the sport of bodybuilding and has written several books and numerous articles on the sport. Schwarzenegger gained worldwide fame as a Hollywood action film icon, noted for his lead roles in such films as Conan the Barbarian, The Terminator, Commando and Predator. He was nicknamed the "Austrian Oak" and the "Styrian Oak" in his bodybuilding days, "Arnie" during his acting career and more recently the "Governator" (a portmanteau of "Governor" and "Terminator"). As a Republican, he was first elected on October 7, 2003, in a special recall election (referred to in Schwarzenegger campaign propaganda as a "Total Recall") to replace then-Governor Gray Davis. Schwarzenegger was sworn in on November 17, 2003, to serve the remainder of Davis''s term. Schwarzenegger was then re-elected on November 7, 2006, in California''s 2006 gubernatorial election, to serve a full term as governor, defeating Democrat Phil Angelides, who was California State Treasurer at the time. Schwarzenegger was sworn in for his second term on January 5, 2007.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (6408, '1979-12-05', NULL, 'From Wikipedia, the free encyclopedia.  Nicolas Kent "Nick" Stahl (born December 5, 1979) is an American actor. Starting out as a child actor, he gained recognition for his performance in the 1993 film The Man Without a Face and then embarked on a successful career as a child actor. He later transitioned into his adult career with roles in Bully, Sin City, In the Bedroom, the HBO series Carnivàle, and the film Terminator 3: Rise of the Machines, in which he took over the role of John Connor, originally played by Edward Furlong. He also recently starred in the film Mirrors 2.  Description above from the Wikipedia article Nick Stahl, licensed under CC-BY-SA, full list of contributors on Wikipedia', 0, 'Harlingen, Texas, USA', 'Nick Stahl');
