INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4111, '1915-08-29', '1982-08-29', 'Ingrid Bergman (29 August 1915 – 29 August 1982) was a Swedish actress who starred in a variety of European and American films. She won three Academy Awards, two Emmy Awards, and the Tony Award for Best Actress. She is ranked as the fourth greatest female star of American cinema of all time by the American Film Institute. She is best remembered for her roles as Ilsa Lund in Casablanca (1942), a World War II drama co-starring Humphrey Bogart and as Alicia Huberman in Notorious (1946), an Alfred Hitchcock thriller co-starring Cary Grant.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4113, '1889-11-10', '1967-05-30', 'Claude Rains (10 November 1889 – 30 May 1967) was an English stage and film actor whose career spanned 47 years; he later held American citizenship. He was known for many roles in Hollywood  films, among them the title role in The Invisible Man (1933), a corrupt senator in Mr. Smith Goes to Washington  (1939), and, perhaps his most famous performance, Captain Renault in Casablanca (1942).
