INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4566, '1946-02-21', '2016-01-14', 'Alan Sidney Patrick Rickman (born 21 February 1946) was  an English actor and theatre director. He was a renowned stage actor in modern and classical productions and a former member of the Royal Shakespeare Company. Rickman was known for his film performances as Hans Gruber in Die Hard, Severus Snape in the Harry Potter film series, Eamon de Valera in Michael Collins, and Metatron in Dogma. He was also known for his prominent roles as the Sheriff of Nottingham in the 1991 film, Robin Hood: Prince of Thieves, and as Colonel Brandon in Ang Lee''s 1995 film Sense and Sensibility. More recently he played Judge Turpin in Tim Burton''s Sweeney Todd: The Demon Barber of Fleet Street and voiced the Caterpillar in Tim Burton''s Alice in Wonderland.
