INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4634, '1974-12-19', NULL, 'Jasmila Žbanić (born 19 December 1974) is a film director from Bosnia and Herzegovina and a graduate of the Academy of Performing Arts in Sarajevo’s Department for Theater and Film Directing. She is noted for the 2006 Golden Bear winning film Grbavica. In 1997, she founded the artist''s association "DEBLOKADA". Her 2010 film Na putu was nominated for the Golden Bear at the 60th Berlin International Film Festival. Description is from Wikipedia under the Creative Commons Attribution-ShareAlike License. Full list of contributors is available on Wikipedia. Photo is from wikipedia user KoljaHub under the Creative Commons Attribution-ShareAlike License.', 0, '', 'Jasmila Zbanic');
