INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1154165, '1975-04-25', NULL, 'Born and raised in the Okanagan Valley, the Irish/English Bruce left Kelowna shortly after highschool graduation and crossed the mountains to attend Simon Fraser University in Vancouver. There, he studied a range of varied topics like film noir, world literature, greek mythology, art history, stage design/direction and even pop culture before receiving his Bachelor Of Arts Degree with Honors. Struggling to decide whether to pursue writing or acting after leaving SFU, Bruce eventually decided on, well, not deciding, and remains active in both having completed feature film scripts and pilots for television. A true lover of movies (his first job was as an usher at Kelowna''s Paramount Theatre) and television (his parents were cable advocates, thank god) Bruce is at home in front of the camera, behind it, and as a fan of the industry, watching it.  IMDb Mini Biography By: HLPublicity', 0, 'Kelowna, British Columbia, Canada', 'Bruce James');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (58707, '1975-11-28', NULL, 'Sunny Mabrey (born November 28, 1975) is an American model and actress who appeared in music videos, such as "Nookie" from Limp Bizkit, before debuting in movies. She appeared in The New Guy, XXX: State of the Union, and was the lead actress in Species III. She appeared in Desperate Housewives as Karl Mayer''s (Richard Burgi) new pregnant wife Marissa Mayer and as a flight stewardess, Shelley, in the Season 3 premiere of Mad Men. Mabrey married actor Ethan Embry in 2005. She is from Gadsden, AL. She started her career in front of the cameras as a fashion model at the age of 18. She has performed in commercials for The Gap.
