INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5079, '1958-11-12', NULL, 'Gilbert Melki est né en 1958, à Paris. Les Melki ont deux enfants, il est le neveu de l''acteur Claude Melki du film L''Acrobate. Son père, originaire de Khenchela, arrive d''Algérie juste avant le commencement de l''insurrection de la Guerre d''Algérie. Sa mère est née enFrance. Ses parents se cachent durant la période de Vichy: son père à Lyon, sa mère en Normandie1.  Son père, antiquaire, l''envoie dans une école d''ébénisterie, mais il y reste seulement quelques mois. À 20 ans, il décide de s''orienter vers la comédie, rêve de devenir acteur et multiplie les cours de théâtre. Après une première apparition au cinéma en 1992 dans le film Betty, Gilbert connaît le succès en 1997 grâce à La Vérité si je mens !de Thomas Gilou, où il incarne Patrick Abitbol, un grand homme d''affaires millionnaire et « mégalo », un rôle qu''il reprend dans les deuxième et troisième volets de cette comédie à succès. Il commence à jouer des rôles dramatiques à partir de 2001 avec Reines d''un jour.  Il interprète le rôle de Jacky dans la série télévisée Kaboul Kitchen diffusée sur Canal+2 depuis 2012.', 0, 'Paris - France', 'Gilbert Melki');
