INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5011, '1959-02-18', NULL, 'Michael Doven has an extensive 25 year career as an executive producer.  The CEO and founder of United Pictures Group credits as Associate Producer in box office movies grossing in the billions of dollars world wide. He is well known as the personal assistant to Tom Cruise in the height of Cruise''s movie career from 1992-2004. Not only was Michael his personal assistant, he acted as the chief of staff to Cruise. During his time, he met and married Andrea Morse, who was another person working for Cruise. 
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5012, '1947-05-20', NULL, 'From Wikipedia, the free encyclopedia  Sky du Mont (born Cayetano Neven du Mont; 20 May 1947) is a German actor. He is known for his role in Eyes Wide Shut, as "Santa Maria" in Der Schuh des Manitu and for narrating the German dub of Thomas &amp; Friends.
