INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5025, '1976-07-19', NULL, 'Vinessa Elizabeth Shaw (born July 19, 1976) is an American actress and model. Shaw has starred in numerous motion pictures since the early 1990s, and is probably most well-known for her performances in Disney''s 1993 Halloween film Hocus Pocus, Ladybugs, the 2006 remake of Wes Craven''s horror picture The Hills Have Eyes, as well as the 2008 romance film Two Lovers, in which she starred alongside Joaquin Phoenix and Gwyneth Paltrow.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (22290, '1982-06-10', NULL, 'Liliane Rudabet Gloria Elsveta Sobieski (born June 10, 1982), known professionally as Leelee Sobieski, is an American actress. Sobieski achieved recognition in her mid-teens for her performance in the 1998 film Deep Impact. She received an Emmy nomination for the 1999 TV movie Joan of Arc, and two Golden Globe nominations for Joan of Arc and the 2001 TV movie Uprising.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (10697, '1965-01-27', NULL, 'Alan Cumming, OBE (born 27 January 1965) is a Scottish stage, television and film actor, singer, comedian, director, producer and author. His roles have included the Emcee in Cabaret, Boris Grishenko in GoldenEye, Kurt Wagner/Nightcrawler in X2: X-Men United, Mr. Elton in Emma, and Fegan Floop in the Spy Kids trilogy. He has also appeared in independent films like The Anniversary Party, which he co-wrote, co-directed and co-starred in; and Ali Selim''s Sweet Land, for which he won an Independent Spirit award as producer. His London stage appearances include Hamlet, the Maniac in Dario Fo''s Accidental Death of an Anarchist, for which he received an Olivier award, the lead in Martin Sherman''s Bent, and as Dionysus in The National Theatre of Scotland''s The Bacchae. On Broadway he has appeared as Mac the Knife in The Threepenny Opera, the Emcee in Cabaret, for which he won the Tony in 1998, and "Design for Living". Cumming also introduces "Masterpiece Mystery" for PBS.
