INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5120, '1960-01-01', NULL, '​Güven Kıraç (d. 1960) Tiyatro ve sinema oyuncusu. Mimar Sinan Üniversitesi Devlet Konservatuvarı Tiyatro Bölümü mezunudur. 1960 yılında İstanbul''da dünyaya geldi. Abhaz kökenlidir .1986 yılından beri birçok televizyon dizisi, reklam filmi ve sinema filminde rol aldı. İki yıl devlet tiyatrosu sanatçısı olarak çalıştıktan sonra istifa etti. Adana Devlet Tiyatrosu''nda Ağrı Dağı Efsanesi, İki Kalas Bir Heves ve Sıkıyönetim; Gülriz Sururi Tiyatrosu''nda ise Tiyatrocu, Sokak Kızı İrma, Hamlet ve Tiyatro Stüdyosu''nda Balkon adlı tiyatro oyunlarında oynamıştır. 1997 yılında Zeki Demirkubuz''un yönettiği "Masumiyet" adlı filmde Yusuf karakteriyle, ÇASOD, MGD ve İsrail Uluslararası Film Festivali''nde En İyi Erkek Oyuncu ödüllerini almıştır. 1998''de Erkan Can ile birlikte Gemide adlı filmde rol aldı. Aynı yıl Laleli''de Bir Azize adlı filmde Aziz karakteriyle karşımıza çıktı. 1999 yılında Salkım Hanım''ın Taneleri adlı filmle 19. İstanbul Film Festivali ''nde En İyi Erkek Oyuncu ödülünü aldı. Aynı yıl Evimiz Olacak Mı? ve Hayat Bağları adlı televizyon dizilerinde rol aldı. 2001 yılında Yeditepe İstanbul adlı filmde Berber Remzi karakterini canlandırdı. 2002 yılında Abdülhamit Düşerken, 2003 yılında Fatih Akın''ın yönettiği Duvara Karşı adlı filmlerde yer aldı. 2004''de Yavuz Turgul''un Gönül Yarası, 2005''de Takva, Hacivat Karagöz Neden Öldürüldü?, Kebab Connection adlı filmlerde rol aldı. 2006 yılında Ömer Faruk Sorak''ın "Sınav" adlı filminde Rafet 69 adlı karakterle karşımıza çıktı.', 0, 'İstanbul, Türkiye', 'Güven Kıraç');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5121, '1970-11-05', NULL, '​Meltem Cumbul (d. 11 Kasım 1970, İzmir), Türk sinema ve dizi oyuncusu.  1988 yılında İzmir Türk Koleji''nden ,1991''de Mimar Sinan Üniversitesi Devlet Konservatuarı Drama Ana Sanat Dalı''ndan mezun oldu. Ardından Londra''daki Şekspir Tiyatro Kumpanyası''nda (Shakespeare Company oyuncu olarak çalıştı. Daha sonra televizyonda bir kariyere adım atarak Aşağı Yukarı (ATV) ve Nereden başlasak? (Kanal D) programlarının sunuculuğunu yaptı. Bu arada filmlerde yardımcı roller de oynadı (Bay E ve Böcek gibi). 1996''da Sahte Dünyalar televizyon dizisinde başrol oynadı.  1997''de televizyonda kendi ismini taşıyan The Meltem Cumbul Show programını başlattı. Bu arada Karışık Pizza, Geboren in Absurdistan ve Anlat Şehrazat Anlat (müzikal) gibi filmlerde başroller aldı.Türk televizyonunda izleyici rekorları kıran Yılan Hikayesi dizisinde başrol oynadı.Daha sonra Biz size aşık olduk, Beşik Kertmesi ve Gurbet Kadını gibi televizyon dizilerin de rol aldı. Abdülhamit Düşerken filmindeki rolüyle Antalya Film Festivali''nde Altın Portakal ödülünü aldı. Mucizeler Komedisi''nde (müzikal), Şener Şen''le birlikte rol aldı.  1998 Eurovision Şarkı Yarışması''nda 2. olan Imaani''nin seslendirdiği Where Are You adlı parçayı Seninleydim ismiyle söyleyip klip çekti. 2004 Eurovision Şarkı Yarışması''nda ise yaptığı sunuculukla beğeni topladı. En son Aşk Yakar dizisinde rol almıştır. Meltem Cumbul aslen Konya Akşehirlidir.', 0, '', 'Meltem Cumbul');
