INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1461, '1961-05-06', NULL, 'Timothy Clooney (born May 6, 1961) is an American actor, film director, producer, and screenwriter. He has received three Golden Globe Awards for his work as an actor and two Academy Awards—one for acting and the other for producing. Clooney is also noted for his political activism and has served as one of the United Nations Messengers of Peace since January 31, 2008.
