INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (139, '1970-04-29', NULL, 'Uma Karuna Thurman (born April 29, 1970)) is an American actress and model. She has performed in leading roles in a variety of films, ranging from romantic comedies and dramas to science fiction and action movies. Following early roles in films such as Dangerous Liaisons (1988), she rose to international prominence in 1994 following her role in Quentin Tarantino''s Pulp Fiction for which she was nominated for an Academy Award, a BAFTA Award and a Golden Globe Award. She starred in several more films throughout the 1990s such as The Truth About Cats &amp; Dogs, Batman &amp; Robin, Gattaca and Les Misérables.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5588, '1976-10-04', NULL, 'From Wikipedia, the free encyclopedia.  Alicia Silverstone ( born October 4, 1976) is an American actress, author, and former fashion model. She first came to widespread attention in music videos for Aerosmith, and is perhaps best known for her roles in Hollywood films such as Clueless (1995) and her portrayal of Batgirl in Batman &amp; Robin (1997).  Description above from the Wikipedia article Alicia Silverstone, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 0, 'San Francisco, California, USA', 'Alicia Silverstone');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3796, '1916-11-23', '2011-03-17', 'From Wikipedia, the free encyclopedia Michael Gough (23 November 1916 – 17 March 2011) was an English character actor who appeared in over 150 films. He is perhaps best known to international audiences for his roles in the Hammer Horror films from 1958, and for his recurring role as Alfred Pennyworth in all four movies of the Burton/Schumacher Batman franchise, beginning with Batman (1989). Description above from the Wikipedia article Michael Gough, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 0, 'Kuala Lumpur, Malaya', 'Michael Gough');
