INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3794, '1915-10-24', '1998-11-03', 'Bob Kane (born Robert Kahn; October 24, 1915 – November 3, 1998) was an American comic book artist and writer, credited as the creator of the DC Comics superhero Batman. He was inducted into both the comic book industry''s Jack Kirby Hall of Fame in 1994 and the Will Eisner Comic Book Hall of Fame in 1996.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5575, '1962-07-07', NULL, 'Akiva J. Goldsman (born July 7, 1962) is an American screenwriter and producer in the motion picture industry. He received an Academy Award for Best Adapted Screenplay for the 2001 film, A Beautiful Mind, which also won the Oscar for Best Picture.
