INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5581, '1954-05-02', NULL, 'Elliot Goldenthal (born May 2, 1954) is an American composer of contemporary classical music. He was a student of Aaron Copland and John Corigliano, and is best known for his distinctive style and ability to blend various musical styles and techniques in original and inventive ways. He is also a film-music composer, and won the Academy Award for Best Original Score in 2002 for his score to the motion picture Frida, directed by his long-time partner Julie Taymor.', 2, 'Brooklyn, NY', 'Elliot Goldenthal');
