INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (406204, NULL, NULL, 'Ve Neill (born Mary Flores) is an American makeup artist. She has won three Academy Awards, for the films Beetlejuice, Mrs. Doubtfire and Ed Wood. She has been nominated for eight Oscars total.[1]  Neill serves as a judge on the 2011 Syfy original series Face Off which features makeup artists competing for $100,000.[2]  Ve Neill has worked on all of the films of the Pirates of the Caribbean franchise. Other notable films she has worked on are Austin Powers in Goldmember, A.I. Artificial Intelligence, Hook, and Edward Scissorhands.', 0, '', 'Ve Neill');
