INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3124, '1966-10-22', NULL, 'Valeria Golino (born 22 October 1966) is an Italian-Greek film and television actress. She is perhaps best known to U.S. audiences for the 1988 Academy Award-winning film Rain Man and the 1988 comedy Big Top Pee-wee, and to international audiences for the Hot Shots! films alongside Charlie Sheen. She has won the David di Donatello, Silver Ribbon, and Coppa Volpi awards.  [From Wikipedia, the free encyclopedia. Description above from the Wikipedia article Valeria Golino, licensed under CC-BY-SA, full list of contributors on Wikipedia.]', 1, 'Naples, Campania, Italy', 'Valeria Golino');
