INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (6422, '1955-10-05', NULL, 'Michał Lorenc (born 5 October 1955 in Warszawa) is one of Poland''s leading film score composers, best known for his work on Bastard (Polish: Bandyta). Since his debut in 1979, he has composed music for more than 150 feature films, documentaries, TV-serials and theatre performances. He won five Golden Lions, Polish Film Festival Awards, for best movie score.', 0, 'Warsaw, Poland', 'Michał Lorenc');
