INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (6523, NULL, NULL, 'Juan José Ballesta debuta en la pequeña pantalla, en 1997, con sólo 8 años en la serie ‘Querido maestro’, protagonizada por Imanol Arias. Dos años después se une al reparto de la ficciónn televisiva ‘Compañeros’. Pero será en el año 2000 cuando empieza a ser popular entre el público tras conseguir el papel protagonista en el drama de Achero Mañas ‘El bola’, por el que se alza con el Goya al mejor actor revelación. En 2003, interpreta a un niño enfermo de cáncer que saca fuerzas para seguir adelante en ‘Planta 4ª’, de Antonio Mercero. Después de un tiempo alejado del cine, regresa en 2005 con ‘7 vírgenes’, por la que gana al Conchad de Plata al mejor actor. En 2010, el actor protagoniza el drama histórico ‘Bruc. El desafío’, y regresa a la pequeña pantalla para unirse al reparto de la ficciónn histórica ‘Hispania’, donde da vida a Paulo.', 0, '', 'Juan José Ballesta');
