INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (6784, '1927-08-17', '2014-06-07', 'Extrait de Wikipedia, l''Encyclopedie libre. Il entame une carrière d''acteur vers trente ans ; avec une centaine de films à son actif, il est l''un des grands acteurs de seconds rôles du cinéma français. Il se fait remarquer par des rôles comme celui du sénateur Dell''Acqua dans Treize femmes pour Casanova de François Legrand ou de l''évêque d''Orléans dans Jeanne d’Arc de Luc Besson. Plus récemment, il était Amédée le doyen des moines dans Des hommes et des dieux de Xavier Beauvois où il joue aux côtés de Lambert Wilson et de Michael Lonsdale. Informations et photo extraites de l''article Jacques Herlin de Wikipedia, licence CC-BY-SA, liste complète des contributeurs sur Wikipedia.', 2, 'Le Vésinet, Yvelines, Île-de-France, France', 'Jacques Herlin');
