INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (514, '1937-04-22', NULL, 'John Joseph "Jack" Nicholson (born April 22, 1937) is an American actor, film director, producer and writer. He is renowned for his often dark-themed portrayals of neurotic characters. Nicholson has been nominated for Academy Awards 12 times. He has won the Academy Award for Best Actor twice, for One Flew Over the Cuckoo''s Nest and for As Good as It Gets. He won the Academy Award for Best Supporting Actor for the 1983 film Terms of Endearment. He is tied with Walter Brennan for most acting wins by a male actor (three), and second to Katharine Hepburn for most acting wins overall (four).
