INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1310, '1921-02-28', '2014-01-03', 'Saul Zaentz (/ˈzænts/; February 28, 1921 – January 3, 2014) was an American film producer and former record company executive. He won the Academy Award for Best Picture three times and in 1996 was awarded the Irving G. Thalberg Memorial Award.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3974, '1932-02-18', NULL, 'Born Jan Tomas Forman in Caslav, Czechoslovakia, on February 18, 1932, a young Milos Forman lost his parents in the Nazi concentration camp at Auschwitz. He studied filmmaking in Prague and made several films in his native country during the 1960s, including his first, Magic Lantern II (1960), before leaving for America. His first American film, Taking Off (1971), received little attention. But the follow-up, One Flew Over the Cuckoo''s Nest (1975), was an unqualified success and earned Forman a Best Director Oscar. After adaptations of the musical "Hair" (1970) and the book Ragtime (1981), Forman directed the Mozart biography Amadeus (1984), which garnered a second Oscar for directing. He continued to strike gold in the biography genre with the Oscar-nominated The People vs. Larry Flynt (1996) and Man on the Moon (1999), which chronicled the bizarre life of comedian Andy Kaufman.', 2, 'Čáslav, Československo', 'Miloš Forman');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2641, '1928-06-20', NULL, '​From Wikipedia, the free encyclopedia.    Martin Landau (born June 20, 1928) is an American actor. Landau began his career in the 1950s; his early films include a supporting role in Alfred Hitchcock''s North by Northwest (1959). He played continuing roles in the television series Mission: Impossible for which he received Emmy Award nominations, and Space:1999. He received a Golden Globe Award for Best Supporting Actor - Motion Picture and his first nomination for an Academy Award for Best Supporting Actor for his work in Tucker: The Man and His Dream, and was also Oscar nominated for his role in Crimes and Misdemeanors (1989). His performance in the supporting role of Béla Lugosi in Ed Wood (1994) earned him the Academy Award, Screen Actors Guild Award and a Golden Globe. He continues to perform in film and television and heads the Hollywood branch of the Actors Studio. Landau was born into a Jewish-American family in Brooklyn, New York, the son of Selma (née Buchanan) and Morris Landau, an Austrian-born machinist who scrambled to rescue relatives from the Nazis.  Description above from the Wikipedia article Martin Landau  licensed under CC-BY-SA, full list of contributors on Wikipedia.', 0, 'Brooklyn, New York, U.S.', 'Martin Landau');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (520, '1965-03-25', NULL, 'Sarah Jessica Parker (born March 25, 1965 in Nelsonville, Ohio) is an American film, television, and theater actress and producer. She is best known for her leading role as Carrie Bradshaw on the HBO television series Sex and the City (1998–2004), for which she won four Golden Globe Awards, three Screen Actors Guild Awards, and two Emmy Awards. She played the same role in the 2008 feature film based on the show, Sex and the City: The Movie, and in its sequel, Sex and the City 2, which opened on May 26, 2010.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4687, '1968-04-08', NULL, 'Patricia T. Arquette (born April 8, 1968) is an American actress and director. She played the lead character in the supernatural drama series Medium for which she won the Primetime Emmy Award for Outstanding Lead Actress in a Drama Series.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4004, '1946-09-28', NULL, 'From Wikipedia, the free encyclopedia.  Jeffrey Duncan Jones (born September 28, 1946) is an American actor. He has appeared in many films and television shows, but may be best known for his roles as Emperor Joseph II in Miloš Forman’s Amadeus, Charles Deetz in Beetlejuice, and dean of students Edward R. Rooney in the 1986 John Hughes film Ferris Bueller''s Day Off.  Description above from the Wikipedia article Jeffrey Jones, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'Buffalo, New York, USA', 'Jeffrey Jones');
