INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1063614, NULL, NULL, 'Once an actor in "Ed Wood," then a director for some movie called Exiles, now a shameless con artist who asked hard-working citizens for their money on Kickstarter for a project titled "Surf Noir," then never gave them what they deserved when they exceeded his goal of $30,000. Nowadays, Tommy just avoids dealing with his problems and refuses to give any updates or rewards to the people that gave their money to him, though he has apparently shown the finished film to everyone except the people that helped him make it. Good luck with that on your conscience, Tommy. May no one fund another one of your films again.', 0, '', 'Tommy Bertelsen');
