INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (10961, '1965-10-30', NULL, 'Gavin McGregor Rossdale  (born 30 October 1965) is an English musician, known as the lead singer and rhythm guitarist of the rock band Bush. Following Bush''s separation in 2002, which lasted for eight years, he was the lead singer and guitarist for Institute, and later began a solo career. He continues to perform both Bush and Institute songs during his solo concerts. Rossdale is married to fellow musician Gwen Stefani.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (3063, '1960-11-05', NULL, 'Katherine Mathilda "Tilda" Swinton (born 5 November 1960) is a British actress known for both arthouse and mainstream films. She won the Academy Award for Best Supporting Actress for her performance in Michael Clayton.
