INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (8554, '1940-05-08', '2006-02-11', 'Peter Bradford Benchley (May 8, 1940 – February 12, 2006) was an American author, best known for his novel Jaws and its subsequent film adaptation, the latter co-written by Benchley (with Carl Gottlieb) and directed by Steven Spielberg. Several more of his works were also adapted for cinema, including The Deep, The Island, Beast, and White Shark.', 0, 'New York City - New York - USA', 'Peter Benchley');
