INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1231, '1960-12-03', NULL, 'Julianne Moore (born Julie Anne Smith; December 3, 1960) is an American actress and a children''s book author. Throughout her career she has been nominated for four Oscars, six Golden Globes, three BAFTAs and nine Screen Actors Guild Awards. Moore began her acting career in 1983 in minor roles, before joining the cast of the soap opera As the World Turns, for which she won a Daytime Emmy Award in 1988. She began to appear in supporting roles in films during the early 1990s, in films such as The Hand That Rocks the Cradle and The Fugitive. Her performance in Short Cuts (1993) won her and the rest of the cast a Golden Globe for their ensemble performance, and her performance in Boogie Nights (1997) brought her widespread attention and nominations for several major acting awards.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5064, '1949-06-22', NULL, 'Mary Louise "Meryl" Streep (born June 22, 1949) is an American actress who has worked in theatre, television and film. She is widely regarded as one of the most talented and respected actresses of the modern era. Streep made her professional stage debut in 1971''s The Playboy of Seville, before her screen debut in the television movie The Deadliest Season in 1977. In that same year, she made her film debut with Julia. Both critical and commercial success came quickly with roles in The Deer Hunter (1978) and Kramer vs. Kramer (1979), the former giving Streep her first Oscar nomination and the latter her first win. She later won an Academy Award for Best Actress for her performance in Sophie''s Choice (1982). Streep has received 16 Academy Award nominations, winning two, and 25 Golden Globe nominations, winning seven, more nominations than any other actor in the history of either award. Her work has also earned her two Emmy Awards, two Screen Actors Guild Awards, a Cannes Film Festival award, four New York Film Critics Circle Awards, five Grammy Award nominations, a BAFTA award, an Australian Film Institute Award and a Tony Award nomination, amongst others. She was awarded the American Film Institute''s Lifetime Achievement Award in 2004. Description above from the Wikipedia article Meryl Streep, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 1, 'Summit - New Jersey - USA', 'Meryl Streep');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (8435, '1956-11-30', NULL, '​From Wikipedia, the free encyclopedia
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4764, '1965-05-24', NULL, 'John Christopher Reilly (born May 24, 1965), better known as John C. Reilly is an American film and theatre actor. Debuting in Casualties of War in 1989, he is one of several actors whose careers were launched by Brian De Palma. To date, he has appeared in more than fifty films, including three separate films in 2002, each of which was nominated for the Academy Award for Best Picture. He was nominated for an Academy Award for Best Supporting Actor for his role in Chicago and a Grammy Award for the song "Walk Hard", which he performed in Walk Hard: The Dewey Cox Story. Description above from the Wikipedia article John C. Reilly, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'Chicago, Illinois, USA', 'John C. Reilly');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (228, '1950-11-28', NULL, 'Edward Allen "Ed" Harris (born November 28, 1950) is an American actor, writer, and director, known for his performances in Appaloosa, The Rock, The Abyss, Apollo 13, A Beautiful Mind, A History of Violence, and The Truman Show. Harris has also narrated commercials for The Home Depot and other companies.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (19, '1959-11-19', NULL, 'Allison Janney is an American actress born in Dayton, Ohio, who studied at Kenyon College where she studied under Paul Newman.  Janney pursued acting partially due to Newman’s encouragement, going on to study drama at the Neighborhood Playhouse and the Royal Academy of Dramatic Art.    Janney is best known for her role as White House Press Secretary (and later Chief of Staff) C.J. Cregg on the television series The West Wing.  Janney’s portrayal of Cregg earned her multiple awards, including four Primetime Emmy Awards and seven Screen Actors Guild Awards, among many others.   Prior to West Wing-fame, Janney performed in numerous American films and soap operas, including American Beauty, As The World Turns, and 10 Things I Hate About You.  Following her considerable television success, Janney has gone on to star in numerous critically acclaimed movies and television programs. She remains active in theatre and often works with fellow West Wing alums. Janney currently lends her voice and talent to television and radio through notable guest spots and commercial advertising.  ', 1, 'Dayton - Ohio - USA', 'Allison Janney');
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (8447, '1955-02-19', NULL, 'Jeffrey Warren "Jeff" Daniels (born February 19, 1955) is an American actor, musician and playwright. He founded a non-profit theatre company, the Purple Rose Theatre Company, in his home state of Michigan. He has performed in a number of stage productions, both on and off Broadway. He has been nominated for the Tony Award as Best Actor for the Broadway play God of Carnage (2009), along with his other three cast-mates.
