INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (2888, '1968-09-25', NULL, 'Willard Christopher "Will" Smith, Jr. (born September 25, 1968) is an American actor, film producer and pop rapper. He has enjoyed success in music, television and film. In April 2007, Newsweek called him the most powerful actor on the planet. Smith has been nominated for four Golden Globe Awards, two Academy Awards, and has won multiple Grammy Awards.
