INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (5916, '1979-05-09', NULL, 'Rosario Dawson (born May 9, 1979) is an American actress, singer, and writer. She has appeared in films such as Kids, Men in Black II, 25th Hour, Sin City, Clerks II, Rent, Death Proof, The Rundown, Eagle Eye, Alexander, Seven Pounds, Percy Jackson and the Olympians: The Lightning Thief and Unstoppable.
INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (4252, '1953-10-09', NULL, 'Anthony Marcus "Tony" Shalhoub (born October 9, 1953) is an American actor. His television work includes the role of Antonio Scarpacci on Wings and sleuth Adrian Monk on the TV series Monk. He has won three Emmy Awards and a Golden Globe for his work in Monk. He also has a successful career as a character actor, with roles in films like Spy Kids, Men in Black, Men in Black II, Galaxy Quest, 1408, Barton Fink, Big Night, The Siege, The Man Who Wasn''t There.
