INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (1240, NULL, NULL, 'Jack has appeared in over 60 feature films, including Men in Black II. One of his most memorable performances was in film Love Liza as Denny, an energetic radio control hobbyist trying to help Philip Seymour Hoffman''s character come to terms with the suicide of his wife. He also had a brief but memorable role in The Big Lebowski as The Dude''s (Jeff Bridges) landlord.
