INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (82702, '1958-08-29', '2009-06-25', 'Michael Joseph Jackson (August 29, 1958 – June 25, 2009) was an American recording artist, dancer, singer-songwriter, musician, and philanthropist. Referred to as the King of Pop, Jackson is recognized as the most successful entertainer of all time by Guinness World Records. His contribution to music, dance, and fashion, along with a much-publicized personal life, made him a global figure in popular culture for over four decades.  Description above from the Wikipedia article Michael Jackson, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'Gary, Indiana, USA', 'Michael Jackson');
