INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (531, '1953-05-29', NULL, 'Daniel Elfman is a composer. Elfman is famous for creating The Simpsons main title theme as well as the Batman theme, and his role as Jack Skellington''s singing voice in The Nightmare Before Christmas.  He is a frequent collaborator with long-time friend Tim Burton and has scored most of his films. He also sang for the character Bonejangles in the movie Corpse Bride.  He has been nominated for four Academy Awards and won a Grammy Award for Tim Burton''s Batman and an Emmy Award for his Desperate Housewives theme. Elfman was honored with the prestigious Richard Kirk award at the 2002 BMI Film and TV Awards.   Earlier in his career, Elfman lead the rock band Oingo Boingo as singer/songwriter from 1976 until its breakup in 1995.', 0, ' Los Angeles, California, United States', 'Danny Elfman');
