INSERT INTO person (person_id, birthday, deathday, biography, gender, place_of_birth, name) VALUES (28782, '1964-09-30', NULL, 'Monica Bellucci (born September 30, 1964) is an Italian actress and fashion model. Bellucci began her career as a model and made a transition to Italian films. She played the role of Persephone in the 2003 science-fiction films The Matrix Reloaded and The Matrix Revolutions, Mary Magdalene in the 2004 biblical drama The Passion of the Christ, and Alex in the controversial art film Irreversible. Bellucci was a Bond girl in the 2015 James Bond film Spectre, making her the oldest Bond girl in the franchise.
