Stephen Edwin King (born September 21, 1947) is an American author of contemporary horror, suspense, science fiction and fantasy fiction. His books have sold more than 350 million copies, which have been adapted into a number of feature films, television movies and comic books. As of 2011, King has written and published 49 novels, including seven under the pen name Richard Bachman, five non-fiction books, and nine collections of short stories. Many of his stories are set in his home state of Maine.

King has received Bram Stoker Awards, World Fantasy Awards, British Fantasy Society Awards, his novella The Way Station was a Nebula Award novelette nominee, and in 2003, the National Book Foundation awarded him the Medal for Distinguished Contribution to American Letters.', 2, 'Portland, Maine, USA', 'Stephen King');

Within the film industry, Grant is cited as an anti-movie star who approaches his roles like a character actor, with the ability to make acting look effortless. Hallmarks of his comic skills include a nonchalant touch of irony/sarcasm and studied physical mannerisms as well as his precisely-timed dialogue delivery and facial expressions. The entertainment media''s coverage of Grant''s life off the big screen has often overshadowed his work as a thespian. He has been vocal about his disrespect for the profession of acting, his disdain towards the culture of celebrity, and hostility towards the media. In a career spanning 20 years, Grant has repeatedly claimed that acting is not a true calling but just a job he fell into.

