Antonia "Toni" Collette (born 1 November 1972) is an Australian actress and musician, known for her acting work on stage, television and film as well as a secondary career as the lead singer of the band Toni Collette &amp; the Finish.

Collette''s acting career began in the early 1990s with comedic roles in films such as Spotswood (1992) and Muriel''s Wedding (1994), for which she was nominated for a Golden Globe Award for Best Actress. Following her performances in Emma (1996) and The Boys (1998), Collette achieved international recognition as a result of her Academy Award-nominated portrayal of Lynn Sear in The Sixth Sense (1999). She has appeared in thrillers such as Shaft (2000) and Changing Lanes (2002) and independent comedy films like About a Boy (2002), In Her Shoes (2005) and Little Miss Sunshine (2006).

In 2009, she began playing the lead role in the television series United States of Tara, for which she won a Primetime Emmy Award and a Golden Globe Award for Best Actress – Television Series Musical or Comedy in 2010.', 1, 'Sydney, New South Wales, Australia', 'Toni Collette');

Weisz started working in television, appearing in Inspector Morse, the British miniseries The Scarlet and the Black, and the television movie Advocates II. She made her film debut in the 1994 film Death Machine, but her breakthrough role came in the 1996 movie Chain reaction, leading to a high-profile role as Evelyn Carnahan-O''Connell in the films The Mummy, in 1999, and The Mummy Returns in 2001. Other notable films featuring Weisz are Enemy at the Gates, About a Boy, Constantine, The Fountain and The Constant Gardener, for which she received the Academy Award for Best Supporting Actress, the Golden Globe Award for Best Supporting Actress and the Screen Actors Guild Award for Outstanding Performance by a Female Actor in a Supporting Role.

Weisz also worked on theatre. Her stage breakthrough was the 1994 revival of Noel Coward''s play Design for Living, which earned her the ''London Critics'' Circle Award for the most promising newcomer. Weisz''s performances also include the 1999 Donmar Warehouse production of Tennessee Williams'' Suddenly Last Summer, and the 2006 revival of A Streetcar Named Desire. Her portrayal of Blanche DuBois in the latter play earned her the Critics'' Circle Theatre Award for Best Actress of 2009.', 1, 'Westminster, London, England, UK', 'Rachel Weisz');

