Morgan Freeman was born in Memphis, Tennessee, the son of Mayme Edna (née Revere) and Morgan Porterfield Freeman, Sr., a barber who died in 1961 from liver cirrhosis. Freeman was sent as an infant to his paternal grandmother in Charleston, Mississippi. He has three older siblings. Freeman''s family moved frequently during his childhood, living in Greenwood, Mississippi; Gary, Indiana; and finally Chicago, Illinois.

Freeman made his acting debut at age 9, playing the lead role in a school play. He then attended Broad Street High School, currently Threadgill Elementary School, in Mississippi. At age 12, he won a statewide drama competition, and while still at Broad Street High School, he performed in a radio show based in Nashville, Tennessee. In 1955, he graduated from Broad Street High School, but turned down a partial drama scholarship from Jackson State University, opting instead to work as a mechanic in the United States Air Force.

Freeman moved to Los Angeles in the early 1960s and worked as a transcript clerk at Los Angeles Community College. During this period, he also lived in New York City, working as a dancer at the 1964 World''s Fair, and in San Francisco, where he was a member of the Opera Ring music group. Freeman acted in a touring company version of The Royal Hunt of the Sun, and also appeared as an extra in the 1965 film The Pawnbroker. He made his off-Broadway debut in 1967, opposite Viveca Lindfors in The Nigger Lovers (about the civil rights era "Freedom Riders"), before debuting on Broadway in 1968''s all-black version of Hello, Dolly!, which also starred Pearl Bailey and Cab Calloway.

Freeman was married to Jeanette Adair Bradshaw from October 22, 1967, until 1979. He married Myrna Colley-Lee on June 16, 1984. The couple separated in December 2007. Freeman''s attorney and business partner, Bill Luckett, announced in August 2008 that Freeman and his wife are in the process of divorce. He has two sons from previous relationships. He adopted his first wife''s daughter and the couple also had a fourth child. Freeman lives in Charleston, Mississippi, and New York City. He has a private pilot''s license, which he earned at age 65, and co-owns and operates Madidi, a fine dining restaurant, and Ground Zero, a blues club, both located in Clarksdale, Mississippi. He officially opened his second Ground Zero in Memphis, Tennessee on April 24, 2008.

Freeman has publicly criticized the celebration of Black History Month and does not participate in any related events, saying, "I don''t want a black history month. Black history is American history." He says the only way to end racism is to stop talking about it, and he notes that there is no "white history month". Freeman once said on an interview with 60 Minutes'' Mike Wallace: "I am going to stop calling you a white man and I''m going to ask you to stop calling me a black man.', 2, 'Memphis, Tennessee, USA', 'Morgan Freeman');

William Thomas Sadler (born April 13, 1950) is an American actor who works in film and television. His television and motion picture roles have included Lewis Burwell "Chesty" Puller in The Pacific, Luther Sloan in Star Trek Deep Space Nine, Sheriff Jim Valenti in Roswell, and—perhaps most notably—the Grim Reaper in Bill &amp; Ted''s Bogus Journey, a role for which he was nominated for, and won, the Saturn Award for Best Supporting Actor, and his role as Colonel Stuart alongside Bruce Willis in Die Hard 2.', 2, 'Buffalo, New York, USA', 'William Sadler');

Brown was born in Urbana, Ohio in 1959 and had an older sister Beth (1958–1965). Their mother Joyce (née Eldridge) was a conductor, composer, and concert pianist. Their father Clarence J. "Bud" Brown, Jr. helped manage the Brown Publishing Company, the family-owned newspaper business started by Clancy''s grandfather, Congressman Clarence J. Brown. From 1965 to 1983 Bud Brown also served as a US Congressman, and later as chairman of the board of Brown Publishing. The family operated the business until 2010.Brown graduated from St. Albans School in Washington, D.C., as his family lived there much of the time when his father served in Congress. He earned a scholarship to Northwestern University, where he became a member of the Sigma Chi Fraternity.

Brown is often cast in roles of villains or authority figures. His career has tended to alternate among mainstream TV/cable; major-studio and independent-studio movies; and a large repertoire of voice work for animated and video game roles.

Personal life

Brown has been married to Jeanne Johnson since 1993; they have a son and daughter.', 2, 'Urbana - Ohio - USA', 'Clancy Brown');

Gil Bellows (born June 28, 1967) is a Canadian film and television actor. He is best known for the roles of Tommy Williams in The Shawshank Redemption, Billy Thomas in the television series Ally McBeal and as CIA agent Matt Callan in the television series The Agency.', 0, 'Vancouver - British Columbia - Canada', 'Gil Bellows');

