Takayo Fischer (born November 25, 1932) is an American stage, film and TV actress, as well as voice-over actress and singer.

Personal life

Fischer was born in Hardwick, California, the daughter of Issei (Japanese immigrants) Chukuro and Kinko Tsubouchi. During World War II, as a young child, she and her family were forcibly evacuated from the West Coast and spent time in the Fresno Assembly Center before being relocated to Jerome and Rohwer internment camps. Fischer later lived in Chicago, Illinois, where, as a young adult, she won the crown of "Miss Nisei Queen." She attended Rollins College from 1951-1953. After her 2nd year at Rollins College she married Dean Doran the day after he graduated from Rollins, in the college chapel, and had 3 children by him within 4 years. Toya: (1954), John (1956) Juliet (1957.). She married Sy Fischer, 2nd husband, (an entertainment executive) on November 29, 1980 . Her 2nd husband has 2 children Stewart and Peter. She resides in Los Angeles.

Career

Fischer appeared in the stage production of The World of Suzie Wong in New York in 1958. She won a Drama-Logue Award for ensemble performance for Tea at the Old Globe Theatre in San Diego. She has also appeared in many productions with East West Players in Los Angeles, including Into The Woods. She toured the U.S. and Europe in The Peony Pavilion in 1997.

Fischer has appeared in many big-budget films, including Moneyball, Pirates of the Caribbean: At World''s End (2007) as Mistress Ching, The Pursuit of Happyness (2006) as Mrs. Chu, Memoirs of a Geisha (2005) and War of the Worlds (2005). She has also worked on many independent Asian American films including Americanese (2009), Only the Brave (2005), Stand Up for Justice: The Ralph Lazo Story (2004) and Strawberry Fields (1997).

Fischer has had numerous guest-starring roles on network television including FX''s It''s Always Sunny In Philadelphia as a North Korean bar owner named Mr. Kim. She is sometimes credited as "Takayo Doran."

Voice work

Fischer has also done voices in several cartoon programmes. Some of her well-known roles included Mister T, Battle of the Planets, Rubik the Amazing Cube, A Pup Named Scooby-Doo, Saturday Supercade, The Flintstone Kids, Batman: The Animated Series, Batman Beyond, The All-New Scooby and Scrappy-Doo Show, The Karate Kid, Capitol Critters, The Centurions, The Plastic Man Comedy/Adventure Show, The Heathcliff and Dingbat Show, Super Friends, Thundarr the Barbarian, Rambo, Wildfire, Captain Planet and the Planeteers, Teen Titans, Justice League Unlimited and Avatar: The Last Airbender.

She has also reprised her role as Mistress Ching in the video game version of Pirates of the Caribbean: At World''s End.', 0, 'Hardwick - California - USA', 'Takayo Fischer');

Meunier was born in Woodburn, Oregon. He played football in high school, and a teammate convinced him to try out for a school production of Guys and Dolls. He was cast as Nathan Detroit and the experience had him "hooked" on acting.He later moved from Oregon to California to attend college. He also attended school in France.', 2, 'Woodburn - Oregon - USA', 'David Meunier');

Dominic Scott Kay (born May 6, 1996) is an American child actor.

He was born in Los Angeles, California, the son of musician and actor Scott Kay. He is probably best known for his cameo appearance in the Easter egg scene of Pirates of the Caribbean: At World''s End as the son of Will Turner (Orlando Bloom) and Elizabeth Swann (Keira Knightley). He is also known as the voice of Wilbur in Charlotte''s Web and Buddha in Air Buddies.

He directed, wrote and starred in a short film called Saving Angelo, a story based on the true events of an abandoned dog left for dead on the side of the road that he and his family rescued in 2003. Kay won the court case over Saving Angelo and hopes to finish it soon and have it distributed to various film festivals. He also wrote and directed another short film, Grandpa''s Cabin.

He is very fond of animals and rescues them with his parents. Kay currently serves as a StarPower Ambassador for Starlight Children''s Foundation. In 2003 he established the band "Wisdom" when he was 7 and is its lead singer.

Description above from the Wikipedia article Dominic Scott Kay,licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'Los Angeles, California, USA', 'Dominic Scott Kay');

Ted Elliott (born 1961) is an American screenwriter. Along with his writing partner Terry Rossio, Elliott has written some of the most successful American films of the past 15 years, including Aladdin, Shrek and Pirates of the Caribbean. In 2004, he was elected to the Board of Directors of the Writers Guild of America; his term on the board ended in 2006. Along with fellow former board member Craig Mazin, Elliott runs The Artful Writer, a website aimed at professional screenwriters. He is also a co-founder with Terry Rossio of Wordplay a.k.a. Wordplayer.com, one of the premier screenwriting sites on the Internet. In 2005, Elliott ran for president of the Writers Guild of America, west, but lost to animation writer and historical figurine maker Patric Verrone. Verrone received 1301 votes; Elliott received 591.

