Cary Grant was born Archibald Alexander Leach in Horfield, Bristol, England, to Elsie Maria (Kingdon) and Elias James Leach, who worked in a factory. His early years in Bristol would have been an ordinary lower-middle-class childhood, except for one extraordinary event. At age nine, he came home from school one day and was told his mother had gone off to a seaside resort. The real truth, however, was that she had been placed in a mental institution, where she would remain for years, and he was never told about it (he wouldn''t see his mother again until he was in his late 20s). He left school at fourteen, lying about his age and forging his father''s signature on a letter to join Bob Pender''s troupe of knockabout comedians. He learned pantomime as well as acrobatics as he toured with the Pender troupe in the English provinces, picked up a Cockney accent in the music halls in London, and then in July 1920, was one of the eight Pender boys selected to go to the US. Their show on Broadway, "Good Times," ran for 456 performances, giving Grant time to acclimatize. He would stay in America. Mae West wanted Grant for She Done Him Wrong (1933) because she saw his combination of virility, sexuality and the aura and bearing of a gentleman. Grant was young enough to begin the new career of fatherhood when he stopped making movies at age 62. One biographer said Grant was alienated by the new realism in the film industry. In the 1950s and early 1960s, he had invented a man-of-the-world persona and a style--"high comedy with polished words." In To Catch a Thief (1955), he and Grace Kelly were allowed to improvise some of the dialogue. They knew what the director, Alfred Hitchcock, wanted to do with a scene, they rehearsed it, put in some clever double entendres that got past the censors, and then the scene was filmed. His biggest box-office success was another Hitchcock 1950s film, North by Northwest (1959) made with Eva Marie Saint since Kelly was by that time Princess of Monaco.', 2, 'Horfield, Bristol, England, UK', 'Cary Grant');

Before becoming a star in American films, she had already been a leading actress in Swedish films. Her first introduction to American audiences came with her starring role in the English remake of Intermezzo in 1939. In America, she brought to the screen a "Nordic freshness and vitality", along with extreme beauty and intelligence, and according to the St. James Encyclopedia of Popular Culture, she quickly became "the ideal of American womanhood" and one of Hollywood''s greatest leading actresses. Her producer David O. Selznick, who called her "the most completely conscientious actress" he had ever worked with, gave her a seven-year acting contract, thereby assuring her continual stardom.

A few of her other starring roles, besides Casablanca, included For Whom the Bell Tolls (1943), Gaslight (1944), The Bells of St. Mary''s (1945), Alfred Hitchcock''s Spellbound (1945), Notorious (1946), and Under Capricorn (1949), and the independent production, Joan of Arc (1948). In 1950, after a decade of stardom in American films, she starred in the Italian film Stromboli, which led to a love affair with director Roberto Rossellini while they were both already married. The affair created a scandal that forced her to return to Europe until 1956, when she made a successful Hollywood comeback in Anastasia, for which she won her second Academy Award, as well as the forgiveness of her fans. Many of her personal and film documents can be seen in the Wesleyan University Cinema Archives.

