Jan Fedder (born 14 January 1955 in Hamburg, Germany) is a German actor. He is best known for his role as police officer Dirk Matthies in the German television show "Großstadtrevier". He is also known for his role as the crude Petty Officer Pilgrim in Wolfgang Petersen''s film, Das Boot.

While filming a scene in which the U-96 is caught in a storm, Fedder lost his footing and was nearly swept off the conning tower set. Bernd Tauber (who played Navigator Kriechbaum) noticed Fedder was suddenly missing and cried out "Mann-über-Bord!" (man overboard). With the cameras still rolling, Tauber helped him to the conning tower hatch. Petersen did not realize at first that it was an accident and said "Good idea, Jan. We''ll do that one more time!" before it came upon him. Fedder was hospitalized and his role was partially rewritten so that he was bed-ridden for a short portion of the film. The footage was developed and the scene in which Pilgrim is nearly swept off the submarine is one of the most memorable moments in the film.', 2, 'Hamburg, Germany', 'Jan Fedder');

