In 2005, LaBeouf made his transition into more mature roles with The Greatest Game Ever Played. In 2007, he starred as the leads in Disturbia and Transformers, and the following year he appeared in Indiana Jones and the Kingdom of the Crystal Skull as Indiana''s son. In 2009, LaBeouf reprised his role as Sam Witwicky in the Transformers sequel Transformers: Revenge of the Fallen, and appeared in New York, I Love You. His upcoming films include the lead roles in Wall Street: Money Never Sleeps, Transformers 3 and The Associate. In 2004, he made his directorial debut by directing "Lets Love Hate" with Lorenzo Eduardo. Five years later he also directed Cage''s music video for the single "I Never Knew You". LaBeouf has been in one long-term relationship, which began in 2004 and lasted three years. He is currently in a relationship with Carey Mulligan; the two began dating in the summer of 2009. In November 2007, LaBeouf was arrested for misdemeanor criminal trespassing in a Chicago Walgreens after refusing to leave; the criminal charges were dropped the following month. In July 2008, LaBeouf was involved in a car accident, which was caused by the other driver. LaBeouf was arrested at the scene of the car accident for misdemeanor drunk driving, and his driver''s license was suspended for one year because he refused a breathalyzer examination. As a result of the injuries he sustained from the accident, he has undergone multiple surgeries on his left hand, which has permanent damage and scarring.', 2, 'Los Angeles, California, U.S', 'Shia LaBeouf');

