Mario "Chip" Cain Van Peebles (born January 15, 1957) is an American director and actor who has appeared in numerous Hollywood films. He is son of filmmaker Melvin Van Peebles.

Description above from the Wikipedia article Mario Van Peebles, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'Mexico City, Distrito Federal, Mexico', 'Mario Van Peebles');

Caine was born Maurice Joseph Micklewhite in Rotherhithe, South East London, the son of Ellen Frances Marie, a cook and charlady, and Maurice Joseph Micklewhite, a fish market porter.

He was married to actress Patricia Haines from 1955 to 1958. They had one daughter named Dominique. He dated Bianca Jagger in 1968. Caine has been married to actress and model Shakira Baksh since 8 January 1973. They met after Caine saw her appearing in a Maxwell House coffee commercial and a friend gave him her telephone number. They have a daughter named Natasha.', 2, 'Rotherhithe - London - England - UK', 'Michael Caine');

Karen Young (born 29 September 1958) is an American actress.

Born in Pequannock Township, New Jersey, Young studied at Rutgers University. After graduation she moved to New York City and became an actress, appearing in such films as 9½ Weeks, Jaws: The Revenge, Daylight, Mercy and Hoffa. Her ex-husband is Tom Noonan. Young portrayed FBI Agent Robyn Sanseverino on The Sopranos and has portrayed various characters for the Law &amp; Order franchise.

