Description above from the Wikipedia article John Terry, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'USA', 'John Terry');

 Member of Earth Wind &amp; Fire since 1971. Also has several solo hits to his credit. Prior to joining the group, was musical director for the Stovall Sisters, a gospel group.  Inducted into the Rock &amp; Roll Hall of Fame in 2000 (as a member of Earth Wind &amp; Fire).  Earth, Wind, &amp; Fire were awarded a Star on the Hollywood Walk of Fame for Recording at 7080 Hollywood Boulevard in Hollywood, California.', 2, 'Denver - Colorado - USA', 'Philip Bailey');

He has received three Academy Award nominations, winning one as Best Supporting Actor for the 1993 thriller film The Fugitive. His notable film roles include federal marshal Samuel Gerard in The Fugitive and its sequel U.S. Marshals, the villain "Two-Face" in Batman Forever, terrorist William Strannix in Under Siege, Agent K in the Men in Black films, former Texas Ranger Woodrow F. Call in Lonesome Dove, Ed Tom Bell in No Country for Old Men, a Texas Ranger in Man of the House and rancher Pete Perkins in The Three Burials of Melquiades Estrada. Jones has also portrayed real-life figures such as businessman Howard Hughes, executed murderer Gary Gilmore, Oliver Lynn in Coal Miner''s Daughter and baseball great Ty Cobb.

Description above from the Wikipedia article Tommy Lee Jones, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, 'San Saba, Texas, USA', 'Tommy Lee Jones');

In the late 1980s, Smith achieved modest fame as a rapper under the name The Fresh Prince. In 1990, his popularity increased dramatically when he starred in the popular television series The Fresh Prince of Bel-Air. The show ran for nearly six years (1990–1996) on NBC and has been syndicated consistently on various networks since then.

In the mid-1990s, Smith transitioned from television to film, and ultimately starred in numerous blockbuster films that received broad box office success. In fact, he is the only actor in history to have eight consecutive films gross over $100 million in the domestic box office as well as being the only actor to have eight consecutive films in which he starred open at the #1 spot in the domestic box office tally. Fourteen of the 19 fiction films he has acted in have accumulated worldwide gross earnings of over $100 million, and 4 of them took in over $500 million in global box office receipts. His most financially successful films have been Bad Boys, Bad Boys II, Independence Day, Men in Black, Men in Black II, I, Robot, The Pursuit of Happyness, I Am Legend, Hancock, Wild Wild West, Enemy of the State, Shark Tale, Hitch, and Seven Pounds. He also earned critical praise for his performances in Six Degrees of Separation, Ali, and The Pursuit of Happyness, receiving Best Actor Oscar nominations for the latter two. From Wikipedia, the free encyclopedia.', 2, ' Philadelphia, Pennsylvania, USA', 'Will Smith');

Elmore Rual Torn, Jr. (born February 6, 1931), better known as Rip Torn, is an American actor of stage, screen and television.

Torn received an Academy Award nomination as Best Supporting Actor for his role in the 1983 film Cross Creek. His work includes the role of Artie, the producer, on The Larry Sanders Show, for which he was nominated for six Emmy Awards, winning in 1996. Torn also won an American Comedy Award for Funniest Supporting Male in a Series, and two CableACE Awards for his work on the show, and was nominated for a Satellite Award in 1997 as well.

