Joel McKinnon Miller, or sometimes credited as Joel McKinnon (born in Minnesota) is an American film and television actor who has been living in Los Angeles since 1991. His most significant role is that of Don Embry on HBO''s drama series Big Love.

Description above from the Wikipedia article Joel McKinnon Miller, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 2, '', 'Joel McKinnon Miller');

In a career of more than four decades, Spielberg''s films have covered many themes and genres. Spielberg''s early science-fiction and adventure films were seen as archetypes of modern Hollywood blockbuster filmmaking. In later years, his films began addressing issues such as the Holocaust, the Transatlantic slave trade, war, and terrorism. He is considered one of the most popular and influential filmmakers in the history of cinema. He is also one of the co-founders of DreamWorks movie studio.

Spielberg won the Academy Award for Best Director for Schindler''s List (1993) and Saving Private Ryan (1998). Three of Spielberg''s films—Jaws (1975), E.T. the Extra-Terrestrial (1982), and Jurassic Park (1993)—achieved box office records, each becoming the highest-grossing film made at the time. To date, the unadjusted gross of all Spielberg-directed films exceeds $8.5 billion worldwide. Forbes puts Spielberg''s wealth at $3.2 billion.', 2, 'Cincinnati - Ohio - USA', 'Steven Spielberg');

James Patrick Caviezel, Jr. (born September 26, 1968) is an American film actor, sometimes credited as Jim Caviezel. He is known for the roles of Jesus Christ in the 2004 film The Passion of the Christ, Bobby Jones in Bobby Jones: A Stroke of Genius, Edmond Dantès in The Count of Monte Cristo, Catch in Angel Eyes and Private Witt in The Thin Red Line.

Description above from the Wikipedia article James Caviezel, licensed under CC-BY-SA, full list of contributors on Wikipedia​', 2, 'Mount Vernon - Washington - USA', 'Jim Caviezel');

Maia Morgenstern (  born May 1, 1962) is a Romanian film and stage actress,  described by Florin Mitu of AMOS News as "a symbol of Romanian theater and film".  In the English-speaking world, she is probably best known for the role of Mary, the mother of Jesus, in Mel Gibson''s The Passion of the Christ. In Romania, she has been nationally known since her 1992 role as Nela in Balanţa, a film known in the United States as The Oak, set during the waning days of Communist Romania.  Description above from the Wikipedia article Maia Morgenstern, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 0, 'Romania', 'Maia Morgenstern');

Description above from the Wikipedia article Monica Bellucci, licensed under CC-BY-SA, full list of contributors on Wikipedia.', 1, 'Città di Castello, Umbria, Italy', 'Monica Bellucci');

Hristo Naumov Shopov (Bulgarian: Христо Наумов Шопов) (born January 4, 1964 in Sofia) is a Bulgarian actor. Shopov''s father, Naum Shopov, is a famous Bulgarian actor as well.

He is most noted for his portrayal of Pontius Pilate in Mel Gibson''s The Passion of the Christ. He has become one of Bulgaria''s most successful actors, making his debut in 1981 with Dishay, choveche (Breathe, Little Man!). His body of work includes many Bulgarian films such as Vchera (Yesterday) and Sledvay me (Follow Me). He has also appeared in several low-budget US film productions including Phantom Force, Target of Opportunity and Alien Hunter. In his homeland, he is best known for his role in the movie Vchera, which became a symbol of several generations. The movie tells the story of young Bulgarian people studying in an English college during Communist rule.

Mary Soan, an assistant director of the film I Am David, suggested that he would be suited for the role of Pilate to Shaila Rubin, who was casting the film. After Hristo and Gibson had a brief conversation, Hristo was given the part. Shopov also played the role of Pontius Pilate in the 2006 film The Inquiry, which also cast Max von Sydow as Emperor Tiberius.

He recently played the Russian premier in the upcoming Command Performance starring and directed by Dolph Lundgren.

